INSERT INTO `sd_post` (`id`, `category_id`, `post_name`, `post_url`, `post_anons`, `post_text`, `post_time`, `post_autor`, `autor_id`, `post_image`) VALUES
	(1, '4', 'Ошибки при устройстве кровель', 'new_post', 'Бывает, что новая кровля вместо положенного ей срока служит не более 3-5 лет.  Это происходит из-за ошибок в проектировании и  технологии монтажа, а также пренебрежения рекомендациями изготовителей. Обратите внимание, что гарантированные сроки службы любо', '<p>Бывает, что новая кровля вместо положенного ей срока служит не более 3-5 лет.  Это происходит из-за ошибок в проектировании и  технологии монтажа, а также пренебрежения рекомендациями изготовителей. Обратите внимание, что гарантированные сроки службы любой кровли выполняются только при соблюдении правил хранения и транспортировки материала, проектирования, <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">монтажа и эксплуатации кровли</a>.</p>\n \n<p><strong>Ошибки проектирования</strong></p>\n<p>1. <em>Отсутствие продуманной отечественной теоретической базы  по данному вопросу.</em> Нормативы  и имеющаяся  учебная литература не учитывают даже половины процессов, протекающих в слоях кровли.  Избежать ошибки пока помогает только собственный практический опыт проектировщика.</p>\n<p>2. <em>Неправильный выбор кровельных материалов, применение несовместимых материалов.</em> Порой желание выбрать «лучшую» кровлю или «вечный» материал не лучшим образом отражается на качестве и долговечности кровли.</p>\n<p>3. <em>При проектировке не учитываются  условия эксплуатации кровельного покрытия.</em> Неграмотная конфигурация кровли может потребовать постоянной очистки «снеговых мешков», наледь на свесах и пр., а это неизбежно повлечет  повреждение кровельного покрытия.</p>\n<p>4. <em>Погоня  за архитектурными формами без учета технических и эксплуатационных моментов.</em> Это обычно проявляется в ухудшении вентиляции между слоями кровли, в малых уклонах на скатных кровлях и т.д.</p>\n<p>5. <em>Неграмотное проектирование отдельных элементов и узлов кровли.</em>  Последствия:  накопление конденсата, протечки, образование «мостиков  холода». </p>\n \n \n<p><strong>Дефекты монтажа</strong></p>\n<p>Ошибки, допущенные строителями на стадии выполнения работ, можно классифицировать следующим образом.</p>\n<p>1. <em>Ошибочная организация последовательности производства работ.</em> Например, часто встречается практику устройства труб, вентиляционных шахт, кабелей и т.п. уже после завершения кровельных работ.</p>\n<p>2. <em>Нарушение технологий выполнения работ.</em> Основная, наиболее частая причина дефектов, приводящая к ослаблению конструкций, нарушению герметичности покрытия и др. Необходимо строго выполнять все технологические операции,  знать различие технологий при применении разных по составу и свойствам материалов. Недопустимо  применение норм для рубероидных кровель к кровлям, выполняемым из современных материалов.</p>\n<p>3. <em>Отступление от проекта.</em> Для устранения дефектов в этих случаях следует выполнить требования, установленные проектом.</p>\n<p><a href="http://www.vertikal-a.ru/vidi-krovlya.htm">Кровельные работы</a> от строителей требуют высокого профессионализма, позволяющего выявить возможные ошибки в проекте и не допустить новых уже на стадии монтажа. \n</p>', '2015-09-24 13:32:28', 'Татьяна Кутукова', '1', 'fasadi_3.jpg'),
	(2, '4', '15-17 сентября 2015 г. г.Ижевск. ', 'vistavka', ' 7-я Всероссийская специализированная выставка.', '<p>«Комплексная безопасность», выставка, которая состоится в Ижевске в сентябре 2015 года, предложит участникам большие возможности для продвижения инновационных технологий и продукции.</p>\n<p>Ее организаторы представят широкий спектр тем: от <a href="http://www.vertikal-a.ru/vidi-fire.htm">пожарной и промышленной безопасности </a>  до медицины катастроф и систем охраны. Вы сможете посетить семинары по вопросам независимой оценки рисков, пожарного аудита и др. актуальным темам.</p>\n', '2015-08-22 12:42:44', 'Татьяна Кутукова', '1', 'soves2.jpg'),
	(4, '4', '30 марта 2016 г. г.Москва.', 'experience', '7-я Межотраслевая конференция.', '"Антикоррозионная защита - 2016", конференция, которая состоится в Москве в марте 2016 года. Она будет посвящена передовым технологиям <a href="http://www.vertikal-a.ru/vidi-antikor.htm">антикоррозионной защиты</a>, лучшим образцам лакокрасочных материалов для защиты от коррозии; <a href="http://www.vertikal-a.ru/vidi-fire.htm">огнезащите</a> и изоляции; а также экспертизе промышленной безопасности; <a href="http://www.vertikal-a.ru/vidi-remont.htm">усилению и восстановлению строительных конструкций зданий</a>, сооружений и оборудования предприятий различных отраслей промышленности.\n', '2015-08-25 13:04:42', 'Татьяна Кутукова', '1', '656.jpg'),
	(5, '4', 'В Ульяновске открыт завод по производству уникальных стройматериалов', 'ideas_mori', 'В Ульяновске заработал первый в России завод по производству гранул древесно-полимерного композита (ДПК) с добавлением твердого пластика. ', '<p>По данным "Стройгазеты" в Ульяновске заработал первый в России завод по производству гранул древесно-полимерного композита (ДПК) с добавлением твердого пластика. </p>\n<p>Основная продукция завода - так называемое жидкое дерево (гранулированный ДПК ) и изделия, производимые из него. В качестве древесного сырья используются древесные опилки местных деревообрабатывающих предприятий. На линии подготовки пластика также будет применяться вторсырье.</p>\n<p>«Жидкое дерево» сочетает преимущества пластика и натурального материала. Изделия из него легко переносят перепады температуры и влажности, устойчивы к гниению, не рассыхаются и не трескаются. </p>\n<p>А для уже построенного жилья и промышленных объектов по-прежнему нужны <a href="http://www.vertikal-a.ru/vidi-fire.htm">огнезащита</a>, <a href="http://www.vertikal-a.ru/vidi-antikor.htm">антикоррозионная защита</a> и <a href="http://www.vertikal-a.ru/uslugi/">другие важные работы по ремонту и строительству</a>.</p>\n', '2015-08-22 12:41:49', 'Татьяна Кутукова', '1', '11.09.14_gorod.jpg'),
	(6, '1', 'История строительной компании Вертикаль-Альфа', 'http://www.vertikal-a.ru/firm-history.htm', 'Фирма «Вертикаль» создана как специализированное предприятие в 1986 году для ремонтно-восстановительных монтажных работ высотных объектов Министерства минеральных удобрений и нефтехимической отрасли.', '<h3>Фирма «Вертикаль» создана как специализированное предприятие в 1986 году для ремонтно-восстановительных монтажных работ высотных объектов Министерства минеральных удобрений и нефтехимической отрасли, в связи с чем был выполнен ряд уникальных проектов в соответствии с  Лицензией  ГС-1-50-02-22-0-7729401028-011674-1:</h3>\n<ul>\n<li>- Строительство зданий и сооружений I и II уровня ответственности в соответствии с государственным стандартом.</li>\n<li>- Реконструкция зданий производственного назначения, ремонт и восстановление несущих конструкций (как металлических, так и бетонных) высотных и обычных зданий и сооружений I и II уровня ответственности (выхлопные трубы, гран-башни, производственные цеха и АБК).</li>\n<li>- Возведение быстровозводимых зданий различного назначения на металлическом каркасе.</li>\n<li>- <a href="http://www.vertikal-a.ru/vidi-antikor.htm">Проведение антикоррозионной и химической защиты конструкций зданий и сооружений на взрывоопасных и химически агрессивных производствах.</a></li>\n<li>- <a href="http://www.vertikal-a.ru/vidi-fire.htm">Проведение огнезащиты металлических и прочих строительных конструкций</a>.</li>\n<li>- Гидроизоляция строительных конструкций и подвальных помещений, в том числе емкости и резервуаров высокопрочными полимерными материалами.</li>\n<li>- <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">Устройство и ремонт облегченных, долговечных кровельных покрытий с использованием современных полимерных материалов; пожаробезопасных (группа горючести Г-1), высокопрочных, в т.ч. отечественного производства</a>.</li>\n<li>а также в соответствии с Лицензией ГС-1-50-02-21-0-779401028-011673-1:\n- Проектирование зданий и сооружений I и II уровня ответственности в соответствии с государственным стандартом.</li>\n<li>- Проведение натурных осмотров с инструментальным обследованием и последующей камеральной обработкой результатов обследования зданий и сооружений I и II уровня ответственности в соответствии с государственным стандартом.</li>\n</ul>\n<p>\nНашим предприятием были произведены обследования технического состояния и эксплуатации, даны рекомендации и технические предложения к проектам капитального ремонта и реконструкции высотных выхлопных труб на таких заводах химической промышленности, как: Воскресенское ОАО «Минудобрения», Щелковский Химический завод, АО «Балаковские минеральные удобрения» г. Балаково, ПО «Фосфор» г. Тольятти, ПО «Куйбышев – Азот», ЗАО «Агро-Череповец», ОАО «Дорогобуж» Смоленская область, Самарский химический завод, Березниковский титаномагниевый комбинат ОАО «АВИСМА», Ефремовский химический завод. \nНа данный момент визитной карточкой компании являются нижеперечисленные направления в работе, которые выполняются в соответствии со Свидетельством №0120.00-2011-7729401028-С-164  СРО «ПрофСтройГрупп», регистрационный номер СРО-С-164-2912009.</p>\n<p>Компания «Вертикаль-Альфа» имеет успешный опыт антикоррозионной защиты морских сооружений - платформ нефтегазодобывающих скважин на Черном море. Основная часть работ была проведена без выведения плавучей платформы из эксплуатации. Ежегодно на заводах химических производств производилась антикоррозионная защита строительных конструкций и оборудования по 10 – 30 тыс. м2. В этот же период производился ремонт высотных вентиляционных труб высотой до 180 метров на химзаводах г. Дорогобуж, г. Россошь и других объектов, на которых кроме усиления и реконструкции производилась антикоррозионная защита и огнезащита строительных конструкций. За 2008 год было выполнено антикоррозионной защиты около 24 000 м2 и огнезащиты около 6 000 м2.  В настоящее время выполняется антикоррозионная защита высотной башни и газоотводящего ствола Н=180м Воскресенского завода минеральных удобрений, а также подходят к завершению работы по антикоррозионной защите 143 тыс. м2 металлоконструкций  башни «Евразия» Н=318м Международного делового центра «Москва-Сити».</p>\n<p>На ряде промышленных предприятий с жесткими условиями химических производств нашим предприятием была применена уникальная технология кровельных покрытий с применением самых современных материалов: Россошанское ОАО «Минудобрения», Дорогобужское ОАО «Дорогобуж», Череповецкое ЗАО «Агро-Череповец», ОАО «КАЗ-СУАЛ» (Мурманская область), Административно-производственный торговый комплекс ЗАО «Электромонтаж» - по технологии НПК «Гидрол-Руфинг». </p>\n<p>Кроме этого, в период с 2002 по 2006 годы выполнялся ремонт кровли Кандалакшинского алюминиевого завода СУАЛ до 10-12 тыс. м2 ежегодно. А также, на объектах капитального строительства в 2008 году были выполнены кровли смешанного типа: черепичная, мягкая и стилобатная с вертолетными площадками на 2-х башнях, возводимых ГлавМосстроем в г. Москва.    </p> \n<p>В период с 2003 по 2005 годы силами компании "Вертикаль-Альфа" были реконструированы  высотные гран-башни Н=120м по 65 000 м3 х 2 сооружения на химзаводе в г. Россоши. В период с 2002 по 2007 - произведена полная реконструкция (с заменой несущих м/конструкций каркаса до 175 т и кровельного покрытия на основе цельносварной полимерной мембраны  «Кровлелон» до 7-12 тыс. м2) 6-ти складов на химзаводах г. Череповец, г. Россошь, г. Дорогобуж. </p>\n<p>Мы готовы, кроме работ по усилению и ремонту строительных конструкций, выполнить монтаж металлоконструкций до 500 т  в год, антикоррозионную защиту ( в т.ч. огнезащиту и химзащиту) конструкций до 100 тыс. м2 в год, кровельных работ до 50 тыс.м2 в год.</p>\n<p>Кроме этого, мы выполняем работы по нанесению тепло-шумоизоляции (вспененных пенополиуретанов и т.п.), торкретированию и ремонту ж/б конструкций, гидроизоляции фундаментов и подвальных помещений, герметизации межпанельных швов, клинингу труднодоступных поверхностей, устройству вентилируемых фасадов, обследованию зданий и сооружений (в т.ч. труднодоступных) и много других нестандартных работ.\nСпециалисты компании, имея большой опыт и опираясь на сотрудничество с передовыми научно-исследовательскими институтами, такими как ГИПИ «Промстальконструкция», «Проектхимзащита», «Проектхиммонтаж», НИИЖБ, способны грамотно и экономически эффективно решить Ваши проблемы в кратчайшие сроки с качеством, соответствующим стандарту ГОСТа  ИСО 9001-2001. </p>\n', '2015-08-21 03:00:05', 'Татьяна Кутукова', '1', 'history.jpg'),
	(7, '1', 'География наших работ', 'http://www.vertikal-a.ru/firm-geogr.htm', 'Нашим предприятием были произведены обследования технического состояния и эксплуатации, даны рекомендации и технические предложения к проектам капитального ремонта и реконструкции высотных выхлопных труб на таких заводах химической промышленности, как: Во', '<p>Нашим предприятием были произведены обследования технического состояния и эксплуатации, даны рекомендации и технические предложения к проектам капитального <a href="http://www.vertikal-a.ru/vidi-remont.htm">ремонта и реконструкции</a> высотных выхлопных труб на таких заводах химической промышленности, как: Воскресенское ОАО «Минудобрения», Щелковский Химический завод, АО «Балаковские минеральные удобрения» г. Балаково, ПО «Фосфор» г. Тольятти, ПО «Куйбышев – Азот», ЗАО «Агро-Череповец», ОАО «Дорогобуж» Смоленская область, Самарский химический завод, Краснодарский ПО «Минудобрение», Белореченский химический завод, Березниковский титаномагниевый комбинат ОАО АЗИСМА, Ефремовский химический завод.</p>\n<p>На всех объектах была произведена современная, высокоэффективная <a href="http://www.vertikal-a.ru/vidi-antikor.htm">антикоррозионная и химическая защита</a> с применением новейших материалов с подготовкой поверхности дробеструйным методом.</p>\n\n<h3>Фирма «Вертикаль» имеет успешный опыт <a href="http://www.vertikal-a.ru/vidi-antikor.htm">антикоррозионной защиты</a> морских сооружений - платформ нефтегазодобывающих скважин на Черном море. Основная часть работ была проведена без выведения плавучей платформы из эксплуатации.</h3>\n<p>Нашим предприятием применена на ряде промышленных предприятий с жесткими условиями химических производств уникальная технология <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">кровельных покрытий</a> с применением самых современных материалов: Россошанское ОАО «Минудобрения», Дорогобужское ОАО «Дорогобуж», Череповецкое ЗАО «Агро-Череповец», ОАО «КАЗ-СУАЛ» (Мурманская область), Административно-производственный торговый комплекс ЗАО «Электромонтаж» - по технологии НПК «Гидрол-Руфинг».</p>\n\n', '2015-08-26 11:54:13', 'Татьяна Кутукова', '1', 'geografy.jpg'),
	(8, '3', 'Огнезащита', 'http://www.vertikal-a.ru/vidi-fire.htm', 'Огнезащита металлоконструкций, воздуховодов, кабелей, древесины и деревянных конструкций.', '<h3>Огнезащита деревянных конструкций, металлоконструкций, воздуховодов, кабелей и древесины</h3>\n\n<blockquote>С 1986 года "Вертикаль-Альфа" предоставляет полный спектр услуг по направлениям: огнезащита металлоконструкций, огнезащита воздуховодов, огнезащита кабелей, огнезащита древесины и деревянных конструкций.\nНаши высококвалифицированные специалисты, имеющие большой опыт этой ответственной работы, выполнят огнезащиту качественно и надежно.</blockquote>\n\n<p>Огнезащита конструкций любого типа – это комплекс мер, направленных на повышение огнестойкости объектов, предотвращение пожаров и минимизацию последствий возгораний на них. Иными словами, огнезащитные меры применяются для повышения фактического предела огнестойкости конструкций до требуемых значений и для снижения предела распространения огня по ним.</p>\n\n<p>Хорошо зарекомендовавший себя способ <strong>огнезащиты конструкций</strong> – это поверхностная обработка элементов с применением огнезащитных красок, лаков, паст, пропиток терморасширяющегося типа.</p>\n\n<p>В соответствии со СНиП 21-01-97 (Пожарная безопасность зданий и сооружений),  различные металлические и деревянные строительные конструкции, в том числе несущие элементы зданий, междуэтажные перекрытия, должны иметь предел огнестойкости, соответствующий их назначению, как указано в таблице.</p>\n\n<img src="http://www.vertikal-a.ru/uploads/505.jpg"  />\n\n<p>Огнезащитные покрытия наносятся как вручную (кистями, валиками, шпателями), так и с помощью специального оборудования - безвоздушным аппаратом высокого давления типа Wagner, Graco в несколько слоев, как показано на схеме:</p>\n\n<img src="http://www.vertikal-a.ru/uploads/502.jpg"  />\n\n<p>Внешне неотличимые от обычной краски, вспенивающиеся огнезащитные материалы под воздействием высокой температуры образуют на поверхности конструкций тепло- и огнезащитную «шубу», которая в течение определенного времени защищает их от огня.</p>\n\n<p>Огнезащитная краска - особая смесь, самозатвердевающая и образующая защитную пленку, которая служит как в качестве огнезащиты, так и в качестве декоративного покрытия. Огнезащитные краски изготавливаются с помощью жидкого калиевого (силикатного) стекла или на водных синтетических суспензиях.</p>\n\n\n<p>Огнезащита конструкций принято разделять на следующие виды, в зависимости от типа объекта:</p>\n\n<li>- огнезащита металлоконструкций;</li>\n\n<li>- огнезащита кабелей и кабельных проходок;</li>\n\n<li>- огнезащита воздуховодов;</li>\n\n<li>- огнезащита древесины и деревянных конструкций.</li>\n\n<p><strong>Огнезащита металлоконструкций</strong></p>\n\n<p>Большинство металлов обладает высокой чувствительностью к температуре и воздействию открытого огня. Несмотря на кажущуюся устойчивость к действию пламени, при нагревании снижаются прочностные характеристики металлов, они деформируются и разрушаются, приводя к разрушению всей конструкции. В зависимости от площади сечения и внутреннего напряжения фактический предел огнестойкости металлических конструкций равен от 0,1 ч до 0,4 ч, при том, что требуемые минимальные значения составляют от 0,5 ч  до 2,5 ч в зависимости от степени огнестойкости сооружений, а также типов конструкций.</p>\n\n<p>Задачей огнезащиты металлоконструкций является создание на поверхностях конструкций теплоизолирующих слоев, устойчивых к действию высоких температур и непосредственному воздействию открытого огня. Теплоизолирующие слои препятствуют нагреванию металла и позволяют сохранять свойства металлоконструкции при пожаре в течение определенного времени.</p>\n\n<p><strong>Огнезащиту металлоконструкций</strong> выполняют как стандартными методами (оштукатуривание, обетонирование, кирпичная кладка), так и современными, такими, как нанесение составов на основе минерального волокна, вспученного перлита и т.д., или использование листовых и плитных материалов (гипсокартон, гипсоволокно, перлитофосфогель и др.). На текущий момент методы огнезащиты металлических конструкций  сильно шагнули вперед вместе с научно-техническим прогрессом.</p>\n\n<p>Современные методы огнезащиты металлоконструкций строятся на использовании следующих материалов:</p>\n<li>- <strong>огнезащитные покрытия</strong> из минерального гранулированного волокна, жидкого стекла, цемента и др.;</li>\n<li>- <strong>вспучивающиеся краски</strong>, которые представляют собой сложные смеси органических и неорганических компонентов. Огнезащитное действие таких красок основано на вспучивании или вспенивании покрытия при температурах 170°С -200°С, в результате чего образуется пористый слой теплоизоляции.</li>\n\n<p>Огнезащита металлоконструкций – важный элемент пожарной безопасности любого здания и сооружения. Она существенно обезопасит конструкции зданий, сооружений от обрушений вследствие пожара. Невысокая стоимость огнезащитных работ, особенно в сравнении с возможными убытками от пожара, полностью оправдывает их проведение на различных объектах, как гражданских, так и промышленных.</p>\n\n<p><strong>Огнезащита кабелей</strong></p>\n\n<p><strong>Огнезащита инженерных систем и электрических кабелей</strong> – еще одна важная задача в ряде задач по обеспечению огнестойкости зданий и сооружений. При возгорании инженерные сети могут стать идеальным местом для распространения огня по всему зданию. Электрические кабели, покрытые горючей оболочкой – средство быстрого распространения пламени, способствующее тотальным пожарам из-за быстрого увеличения количества очагов возгорания. Кроме того, электрические кабели, в основном, изготавливаются с горючей изоляцией на основе ПВХ. При сгорании такой изоляции, выделяется резкий удушливый газ хлороводород. Для предотвращения этих последствий необходимо как можно раньше произвести огнезащиту кабелей и кабельных проходок в здании.</p>\n\n<p>В случае воспламенения<strong> огнезащита кабелей</strong> и кабельных проходок препятствует распространению пламени и продуктов горения. Огнезащита кабелей и кабельных проходок особенно важна для помещений с огнеопасными средами, легковоспламеняющимися жидкостями, а также в местах массового скопления людей (рестораны, клубы и т.д.). При огнезащите кабелей обязательное условие – это использование краски, обладающей хорошей адгезией (слипание поверхностей разнородных тел) к оболочке кабеля.</p>\n\n<p>Огнезащитная краска для кабеля — это огнезащитный состав, уменьшающий воздействие пламени на кабель. Огнезащита кабелей и кабельных проходок - это недорогой способ обезопасить себя от проблем в случае пожара или возгораний проводки. </p><blockquote>Наши специалисты используют для проведения таких работ только качественные и проверенные краски.</blockquote>\n\n<p><strong>Огнезащита воздуховодов</strong></p>\n\n<p>Огнезащита воздуховодов – одна из наиболее сложных задач в комплексе противопожарных мероприятий. Работы по огнезащите таких конструкций могут быть проведены только с использованием материалов, описанных в сертификатах противопожарной безопасности в разделе: "Огнестойкий воздуховод с огнезащитным покрытием".</p>\n\n<p><strong>Огнезащита воздуховодов</strong> – это важная часть обеспечения пожаробезопасности зданий и сооружений. При возникновении пожара именно по воздуховодам происходит распространение огня, дыма и продуктов горения, так как система вентиляции  обычно связывает все помещения в здании. Избежать этого поможет своевременное выполнение мероприятий по огнезащите воздуховодов.</p>\n\n<p>В любом здании на стадии проектирования должно быть предусмотрено наличие противопожарных устройств, таких как: противопожарные клапаны, воздушные затворы, огнезащитные покрытия. Вентиляция, используемая для выведения воздуха, проходит через все этажи здания и, в случае пожара, если отсутствует надлежащая огнезащита, дым, пламя и продукты горения быстро распространятся из одного помещения по всему зданию. В целях противопожарной безопасности все системы вентиляции должны отвечать требованиям по огнезащите воздуховодов, изложенным в санитарных нормах и правилах (СНиП по вентиляции).</p>\n\n<p>Степень огнезащиты воздуховодов зависит от толщины слоя огнезащитного покрытия и применяемых материалов. В случае возникновения пожара огнезащитные составы, покрывающие воздуховоды, вспениваются, образуя пористый теплоизоляционый слой, препятствующий распространению огня. В качестве огнезащитного покрытия используют специальные огнезащитные краски и огнезащитные штукатурки. Для ткани и дерева применяются огнезащитные пропитки. Огнезащитная пропитка действует очень просто: достаточно пропитать основной материал (ткань или волокна древесины), и он практически теряет способность воcпламеняться. Обработка воздуховодов не требует больших временных и финансовых затрат, а вероятность последствий при возникновения пожара уменьшается в разы, повышается пожаробезопасность помещений и здания в целом.</p>\n\n<p><strong>Огнезащита древесины и огнезащита деревянных конструкций</strong></p>\n\n<p><strong>Огнезащита древесины и деревянных конструкций</strong> - наиболее распространенные мероприятия по огнезащите. Древесина – это материал с высокой горючестью, по этой причине крайне важно и необходимо проводить огнезащиту деревянных конструкций. Представляя собой уникальный по своим экологическим и эстетическим свойствам, натуральный строительный материал, древесина дает широкие возможности для применения ее в строительстве. Однако высокая горючесть древесины и угроза уничтожения зданий и конструкций из этого материала по причине пожара, является едва ли ни единственным препятствием для ее использования. Применение современных огнезащитных материалов решает эту проблему, снижая риск возгорания и распространения пожаров на конструкциях из древесины.</p>\n\n<p>Среди самых часто применяющихся способов огнезащиты деревянных конструкций – обработка огнезащитными красками и пропитками. Принцип действия огнезащитных красок заключается в том, что под действием открытого пламени образуется вспененный теплоизоляционный слой, который и препятствует дальнейшему нагреванию конструкции. Таким образом, огнезащитные краски, наносимые при проведении огнезащиты древесины и деревянных конструкций, препятствуют распространению пламени, а иногда и способны предотвратить сам пожар.</p>\n\n<p>Применение специальных огнезащитных пропиток – <em>антипиренов</em> для огнезащиты древесины отличается тем, что пропитка, в отличие от краски, проникает глубоко внутрь волокон древесины и придает ей свойство негорючести. В случае возгорания, деревянные конструкции, обработанные антипиреном, лишь обугливаются в местах прямого взаимодействия с пламенем.</p>\n\n<p>Наша организация производит огнезащиту древесины и деревянных конструкций после проведения сравнительного анализа всех представленных материалов и выбора наиболее оптимального в каждом конкретном случае. Для работ в области противопожарной безопасности используются покрытия как отечественного, так и импортного производства.</p>\n\n<blockquote>Мы рекомендуем проводить комплексные мероприятия по огнезащите зданий и сооружений, направленные на повышение пожаробезопасности объектов. Это позволит уберечь их от огня и избежать тяжких последствий пожаров.</blockquote>', '2015-08-22 11:28:00', 'Татьяна Кутукова', '1', 'fireproof3.jpg'),
	(9, '3', 'Ремонт и усиление несущих и ограждающих конструкций', 'vidiremont', 'Работы по усилению и замене элементов несущих строительных конструкций различной сложности.\n', 'В тесном сотрудничестве наших специалистов - проектировщиков и линейного персонала - с ведущими проектировщиками Москвы и России, таких как "Ленпроектстальконструкция", государственное предприятие Центральный научно-исследовательский проектный и конструкторско-технологический институт легких конструкций "ЦНИИпроектлегконструкция", был осуществлен ряд уникальных работ по усилению и замене поясов несущих конструкций опорных башен выхлопных труб высотой до 200 метров на следующих заводах: ОАО "Дорогобуж", ОАО "Минудобрения", г. Россошь, ОАО "Балаковский завод минеральных удобрений", ПО "Куйбышев Фосфор" и т.д.\nВ том числе накоплен большой опыт по замене вертикальных и горизонтальных отводящих газоходов и стволов выхлопных высотных труб H=150-180 метров как, например:\n<div class="row">\n<ul>\n<li>- замена алюминиевого ствола на стальной из аустерлитовой стали - на Балаковском химическом заводе концерна "Иргиз";</li>\n<li>- ремонт и замена деревянного ствола на фаолитовый диаметром от 2000мм до 7000мм;</li>\n<li>- ремонт опорной башни и титанового ствола на ОАО "Березниковский титано-магниевый комбинат";</li>\n<li>- ремонт и замена фаолитового ствола на ОАО "Белореченский завод минеральных удобрений";</li>\n<li>- демонтаж опорных башен и выхлопных труб на Уваровском химичнском заводе.</li>\n</ul>\n</div>\n<p>\nБыл разработан большой арсенал технологических приемов, приспособлений и оснастки для проведения уникальных работ по усилению и замене элементов несущих строительных конструкций, как высотных выхлопных труб, так и каркасов промышленных зданий и сооружений различной сложности.</p>', '2015-08-22 11:27:53', 'Татьяна Кутукова', '1', 'remont.jpg'),
	(10, '1', 'О компании', 'okompanii', 'Компания "Вертикаль-Альфа" создана в 1986 году и до сих пор удерживает лидерство на современном рынке промышленного альпинизма и высотных работ.\nНаши специалисты за прошедшие годы приобрели огромный опыт в проведении высотных работ, огнезащиты и промышле', '<p>Компания "Вертикаль-Альфа" начала свою работу в 1986 году и до сих пор удерживает лидерство на современном рынке промышленного альпинизма и высотных работ.\nНаши специалисты за прошедшие годы приобрели огромный опыт в проведении высотных работ, огнезащиты и промышленного альпинизма. Постоянное сотрудничество с передовыми НИИ дает нам возможность грамотно и экономически оптимально разрешить Ваши трудности в минимальные сроки с качеством, соответствующим стандарту ГОСТа Р ИСО 9001-2001.</p>\n<p>Огромный практический опыт промышленного альпинизма и высотных работ, а также постоянное обучение специалистов компании современным тенденциям профильной деятельности способствуют научно-техническому прогрессу фирмы, наращиванию потенциала и расширению сферы деятельности. <a href="http://www.vertikal-a.ru/vidi-fire.htm">Профессиональная огнезащита конструкций</a>, высотные работы повышенной сложности, промышленный альпинизм всероссийского масштаба - это далеко не весь список наших возможностей.</p>\n<p>Специалисты компании квалифицированно выполняют все виды высотных работ и промышленного альпинизма: <a href="http://www.vertikal-a.ru/vidi-fasad.htm">ремонт фасадов</a>, <a href="http://www.vertikal-a.ru/vidi-fire.htm">огнезащита</a> высотных сооружений, <a href="http://www.vertikal-a.ru/vidi-remont.htm">ремонт и усиление несущих конструкций</a>, <a href="http://www.vertikal-a.ru/vidi-antikor.htm">антикоррозийные работы</a>, <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">кровельные работы</a> и многое другое. Ежеквартально тратятся средства на обучение промышленному альпинизму сотрудников кампании.</p>\n<p>В сферу наших услуг входит как гражданское, так и промышленное строительство, компания ведет активные высотные работы на территории всей страны. Промышленный альпинизм любого уровня сложности, так как наши сотрудники прошли специальные курсы промышленного альпинизма.</p>', '2015-08-21 03:07:46', 'Татьяна Кутукова', '1', 'about_company.jpg'),
	(11, '3', 'Кровельные работы: ремонт кровли, монтаж кровли', 'krovlya', 'Кровля - наиболее важный элемент сооружения, от её добротности и надежности зависит сохранность и долговечность всего здания, включая оборудование, внутреннюю отделку.', '<h3>Кровля, ремонт кровли, монтаж кровли, напыляемая кровля, кровля из пвх мембран</h3>\n<p><strong>Кровля</strong> – это один из основных, наиболее важных элементов конструкции здания, от её надежности и исправности зависит не только внутренняя отделка, но и сохранность оборудования, находящегося внутри объекта и долговечность всех прочих конструктивных частей здания или сооружения.</p>\n\n<blockquote>"Вертикаль-Альфа" предоставляет полный комплекс услуг, направленных на обслуживание кровли. Наши высококвалифицированные специалисты, имеющие большой опыт качественной работы, выполнят ремонт и монтаж кровли быстро и надежно.</blockquote>\n\n<p>Руководствуясь СНиП II-26-76 "Кровли" - выделяют такие элементы крыши, как: покрытие (слой материала для непосредственной защиты помещений от погодных воздействий), подкровельные конструкции, основание под кровлю, кровельный ковёр, дополнительный водоизоляционный ковёр, защитный слой.</p>\n\n<p><strong>По материалу, из которого изготавливаются кровельные покрытия, кровли классифицируют на:</strong></p>\n\n<li>- полимерные (на основе полимерных мембран, напыляемые, мастичные, наливные);</li>\n\n<li>- металлические (стальные, алюминиевые, медные, кровли из сплавов);</li>\n\n<li>- битумные (на основе битума, с добавлением или без добавления полимеров);</li>\n\n<li>- цементно-волокнистые;</li>\n\n<li>- цементно-песчаные (формованная бетонная черепица);</li>\n\n<li>- керамические (глиняная обожженная черепица);</li>\n\n<li>- пластмассовые (стекловолокнистый пластик, оргстекло);</li>\n\n<li>- стеклянные.</li>\n\n<p>Выбор кровельных материалов – задача непростая, необходимо учесть большое количество аспектов: тип сооружения, его назначение, конструктивные особенности крыши, климатический пояс, а также пожелания и финансовые возможности заказчика.</p> <blockquote>Мы поможем Вам разобраться в преимуществах и недостатках имеющихся на рынке кровельных материалов и сможем подобрать оптимальный вариант для каждого конкретного случая.</blockquote>\n\n<p>Традиционные кровельные материалы на битумной основе (рубемаст, пергамин, рубероид и подобные) довольно легко подвергаются разрушению. Это происходит, как правило, за счет окисления составляющих самого битума. Масла превращаются в смолы, а те, в свою очередь, переходят в асфальтены, карбоиды, карбены, что  приводит к образованию трещин в материале. Воздействие солнечных лучей и перепады температуры в осенне-весенние периоды во много раз ускоряют процесс разрушения.</p>\n\n<p>Современные разработки привели к созданию новых материалов, где роль связующего играют модифицированные битумы, а вместо бумажной основы применяется стеклоткань и полиэстер. Для защиты от ультрафиолета поверх битумного основания используют покрытие из базальтовой или сланцевой крошки (гранулят). Несмотря на то, что такие материалы имеют больший вес (3-6 кг/м2 вместо 1-2 кг/м2), процесс их укладки и монтаж оказывается проще и технологичнее. Современные материалы имеют более высокую стоимость, однако укладываются в два слоя, напротив нескольких слоев устаревших традиционных материалов и служат гораздо дольше, что позволяет снизить стоимость кровельных работ.</p>\n<h3>Мембранные пожаробезопасные кровли</h3>\n<p>Важным показателем кровельных материалов, в частности, рулонных, является их горючесть. В зависимости от значений параметра горючести все строительные материалы подразделяют по ГОСТ 30244-94 на 4 группы, как показано в таблице:</p>\n \n<table>\n<tbody>\n<tr>\n<td rowspan="2" width="167"><strong>Группа горючести материалов</strong></td>\n<td colspan="4" width="451"><strong>ПАРАМЕТРЫ ГОРЮЧЕСТИ</strong></td>\n</tr>\n<tr>\n<td width="104"><strong>Температура дымовых газов Т, °С</strong></td>\n<td width="104"><strong>Степень повреждения по длине SL, %</strong></td>\n<td width="104"><strong>Степень повреждения по массе, Sm, %</strong></td>\n<td width="139"><strong>Продолжительность горения tc.r, °С</strong></td>\n</tr>\n<tr>\n<td width="167"><strong>Г1 (слабогорючие)</strong></td>\n<td width="104">≤135</td>\n<td width="104">≤65</td>\n<td width="104">≤20</td>\n<td width="139">0</td>\n</tr>\n<tr>\n<td width="167"><strong>Г2 (умеренногорючие)</strong></td>\n<td width="104">≤235</td>\n<td width="104">≤85</td>\n<td width="104">≤50</td>\n<td width="139">≤30</td>\n</tr>\n<tr>\n<td width="167"><strong>Г3 (нормальногорючие)</strong></td>\n<td width="104">≤450</td>\n<td width="104">˃85</td>\n<td width="104">≤50</td>\n<td width="139">≤300</td>\n</tr>\n<tr>\n<td width="167"><strong>Г4 (сильногорючие)</strong></td>\n<td width="104">˃450</td>\n<td width="104">˃85</td>\n<td width="104">˃50</td>\n<td width="139">˃300</td>\n</tr>\n</tbody>\n</table>\n \n\n<p>Нами была проведена работа по освоению оригинальной технологии с использованием современных тепло- и гидроизоляционных кровельных материалов. </p> <blockquote>Мы предлагаем широкий спектр услуг по монтажу и ремонту кровли различных видов с использованием гидроизоляционных мембран из современных полимерных материалов с использованием новейших методов.</blockquote><p>Отличительной особенностью предлагаемой технологии в сравнении с традиционной рулонной кровлей состоит в ее пожаробезопасности, а также отличной морозостойкости и атмосферостойкости, прочности и надежности. Также данная технология позволяет избежать применения открытого огня при укладке кровли.</p>\n\n<p>Основные системы монтажа кровли на основе полимерных гидроизоляционных мембран отличаются вариантами их крепления.</p>\n\n<p>Механическое крепление:</p>\n <img src="http://www.vertikal-a.ru/uploads/11.jpg" />\n<p>Сплошное крепление:</p>\n<img src="http://www.vertikal-a.ru/uploads/12.jpg" />\n<p>Балластное крепление:</p>\n<img src="http://www.vertikal-a.ru/uploads/13%20%281%29.jpg" />\n<p>На особо ответственных объектах при монтаже или ремонте кровли применяется комплексное крепление, состоящее в парном использовании двух основных способов, что обеспечивает повышенную надёжность кровли.</p>\n\n<p>Механическое крепление повышает прочность покрытия по швам, сокращает время монтажа кровли с большим уклоном и сложным профилем. Технология высокоэффективна при ремонте и монтаже кровли из профилированного металлического листа. Герметизация швов обеспечивается сплошной проваркой шва (для материалов на основе ПВХ) или проклейкой с последующей герметизацией шва спецгерметиком (на основе EPDM).</p>\n\n<blockquote>Нашей компанией опробованы и освоены технологические методы, основанные на трех вариантах сплошного крепления полимерной мембраны: "припенивание" с использованием жесткого пенополиуретана, приклеивание с применением органических и неорганических клеев, укладка на битумный ковер.</blockquote>\n\n<strong>Вариант монтажа кровли с пенополиуретаном имеет ряд преимуществ:</strong>\n\n<li>- гидроизоляционное покрытие дублируется (добавляется мембрана к гидроизоляционному уретановому покрытию);</li>\n\n<li>- внешняя нагрузка распределяется на основание кровли, что способствует повышению надежности и эксплуатационные характеристики;</li>\n\n<li>- при использовании теплоизоляционной минераловатной плиты профиль кровли сглаживается в местах примыканий и стыков;</li>\n\n<p>Описанный способ применяется при устройстве облегченной кровли с монолитным утеплителем из пенопластов. Таким образом, на смонтированное покрытие с помощью специального оборудования укладывается сплошной монолитный слой утеплителя (полиполиуретана), толщина которого обусловлена теплотехническими требованиями. Данный метод предотвращает возникновение «продыхов», а также тепловых мостиков в теплоизоляции, обеспечивая однородность монтажа по всей кровле. Как нельзя лучше для этого метода подходят материалы группы горючести Г1 по ГОСТ 30244-94.</p>\n\n\n\n<strong>Кровли подобного устройства были смонтированы ООО «Вертикаль-Альфа» на следующих объектах:</strong>\n\n<li>- ОАО "Минудобрения", г. Россошь, 25 000 м2,</li>\n\n<li>- ЗАО "Агро-Череповец", г. Череповец, 15 000 м2,</li>\n\n<li>- ОАО "Дорогобуж", г. Дорогобуж, 10 000 м2,</li>\n\n<li>- ОАО КАЗ СУАЛ, г. Кандалакша, 18 000 м2.</li>\n\n<p>Высокие эксплуатационные качества приобретают существующие битумные кровли при модернизации и ремонте кровли с использованием ПВХ мембран. Для этого после ремонта битумного ковра по традиционной схеме на него накладывается 1-слойное покрытие из полимерно-битумного материала, а на него наплавляется рулон ПВХ с последующей сваркой межрулонных швов.</p>\n\n<h3>Напыляемые кровли</h3>\n<p>При устройстве и ремонте кровель рулонные битумные материалы получили наиболее широкое распространение. Они изначально доступны по стоимости, просты в монтаже, а для многих организаций, осуществляющих ремонтно-строительные работы, важным является возможность сэкономить на использовании дорогого оборудования и квалифицированного персонала. </p><p>Для проведения работ по монтажу и ремонту рулонных битумных кровель используется метод наплавления открытым огнем, что сказывается на безопасности, а также на качестве кровельных работ: локально возникают «непровары», которые ведут к плохому свариванию слоев и образованию пустот, а также «пережоги», разрушающие саму мембрану. </p><p>Так как температура плавления полимерно-битумных материалов выше, чем та, при которой разрушаются введенные в битум полимеры,  происходит дополнительное снижение гидроизоляционных свойств покрытия, а, следовательно,  и срока его эксплуатации.</p> <p>Еще один минус этой технологии - большое количество стыков. Достигнуть герметичности сопряжений в местах примыкания к парапетам, воронкам, вытяжным шахтам и другим элементам очень сложно.</p>\n<p>Зачастую в процессе ремонта битумной кровли обнаруживается большое количество старых слоев гидроизоляции, восемь и более. Чтобы дополнительно не нагружать и без того перегруженную кровлю, в таких случаях следует выполнить полное снятие всего кровельного покрытия. </p>\n<p>Так называемые <strong><em>напыляемые кровли</em></strong> позволяют избежать подобных сложностей, а также прочих недостатков наплавляемых кровель. Напыляемые кровли являются наиболее современными и перспективными системами гидроизоляции кровли, надежность которых гарантирует не годы, а десятилетия беспроблемной эксплуатации.</p>\n\n<p>Данная технология позволяет производить гидроизоляцию или ремонт даже  при сложной геометрической конфигурации кровли, при наличии множественных примыканий и установленного оборудования. Наносятся напыляемые материалы механизированным способом аппаратами высокого давления. <strong>В результате, в кратчайшие сроки создается покрытие с уникальными прочностными и эксплуатационными свойствами. </strong>Бригада, состоящая из двух-трех работников, может подготовить и укрыть до 1000 м2 ремонтируемой или вновь сооружаемой кровли за одну смену.</p>\n\n</p><strong>Напыляемые кровли,</strong> как правило, представляют собой двухкомпонентные полимерные композиции, состоящие из основы и отвердителя (например, полимочевина, полиуретан, жидкая резина, битумно-латексная эмульсия), смешивание и распыление которых производится с помощью специализированного оборудования. </p><p>Нанесенная на подготовленную поверхность полимерная композиция в течение короткого промежутка времени твердеет, образуя сплошную гидроизоляционную мембрану с высокой прочностью и адгезией. Толщина слоя напыляемой кровли 2 мм по своим характеристикам соответствует 4 слоям рулонного полимерно-битумного материала.</p>\n<p></p>\n<p>Технология напыления применяется при таких работах, как:</p>\n\n<li>- монтаж и ремонт кровли из разных материалов (мягкой, шиферной, металлической кровель);</li>\n\n<li>- ремонт и монтаж кровли со сложной геометрией;</li>\n\n<li>- аварийный ремонт кровли;</li>\n\n<li>- <a href="http://www.vertikal-a.ru/vidi-antikor.htm">антикоррозионная защита</a>;</li>\n\n<li>- гидроизоляция фундаментов, подвалов и т.п.</li>\n<p></p>\n<p>Особенности напыляемой кровли:</p>\n\n<li>- бесшовность;</li>\n\n<li>- малый вес покрытия (около 3 кг на 1 м2);</li>\n\n<li>- высокая производительность работ;</li>\n\n<li>- высокая степень адгезии к большинству используемых материалов;</li>\n\n<li>- повышенная химическая стойкость;</li>\n\n<li>- отсутствие необходимости использования открытого пламени;</li>\n\n<li>- длительный срок службы (до 30 лет и более).</li>\n<p></p>\n<p>К основным свойствам напыляемой кровли относят:</p>\n\n<li>- пожаробезопасность (не применяется открытый огонь при проведении работ, кровельные покрытия не поддерживают горения и, как правило, являются самозатухающими);</li>\n\n<li>- технологичность (укрытие больших площадей в самые короткие сроки);</li>\n\n<li>- износостойкость (высокие абразивостойкие показатели покрытия);</li>\n\n<li>- химстойкость (инертность к воздействию большинства химических составов);</li>\n\n<li>- долговечность.</li>\n<p></p>\n<p>Такие напыляемые покрытия, как полимочевина и полиуретан – наиболее современные и перспективные системы кровельной гидроизоляции.</p>\n\n \n<h3>Мембранная кровля из ПВХ</h3>\n<p><strong>ПВХ мембрана</strong> - это еще один современный кровельный материал, к свойствам которого относят высокую надежность и возможность выбора цвета покрытия для решения самых разнообразных задач. Основой ПВХ мембран является пластифицированный <em>поливинилхлорид</em> с полиэфирной сеткой в качестве армирующего слоя.</p>\n\n<p>Для мембран из ПВХ характерна высокая устойчивость к воздействию ультрафиолета, они способны долгое время противостоять негативному влиянию солнечного света. Основные свойства этих материалов подвержены незначительным изменениям при температурах от -30 °C до +80 °C, что позволяет проводить монтажные работы при температурах от -5 °C до +40 °C. Кровли из ПВХ устойчивы к резким, чередующимся перепадам температур, а на короткие сроки – даже к значительному перегреву (к примеру, при сварке горячим воздухом, температура может достигать 500 °C, что не приводит к разрушению материала).</p>\n\n<p><strong>Полимерная кровля</strong> характеризуется эластичностью, надежностью, повышенной стойкостью к атмосферным и климатическим воздействиям, и, в отличие от других типов кровель, сохраняет свои свойства при широком диапазоне температур. Мембраны из ПВХ хорошо выдерживают химическое воздействие, а также обладают значительной огнестойкостью и высокой механической прочностью. А за счет своего небольшого веса (как правило, не более 2 кг/м2), нагрузки на несущую конструкцию минимальны. Использование кровли из ПВХ особенно целесообразно на плоских кровлях производственных, общественных зданий и крупных жилых домов, где высоки требования к экономичности и надежности в процессе эксплуатации. Применение ПВХ мембран возможно как для монтажа новой кровли, так и для ремонта старого битумного покрытия.</p>\n\n<p><strong>Монтаж ПВХ мембран</strong> производят в один слой, что уменьшает время работ и расход гидроизоляционного материала. Это позволяет добиться сопоставимых уровней стоимости мембранной ПВХ кровли и битумной кровли при очевидных преимуществах первой. При необходимости, монтаж кровельной мембраны можно осуществлять в любых погодных условиях, даже при пониженных температурах (рекомендуется до -5 °C). В процессе монтажа материал прикрепляется к основанию механическим, клеевым или балластным методом, а межрулонные швы привариваются с помощью автоматических сварочных машин горячим воздухом. Такой способ монтажа позволяет получить более прочный шов, в сравнении с наплавляемыми битумными покрытиями, и практически пожаробезопасен.</p>\n\n<p>На Российском рынке широко представлены как импортные материалы для монтажа и ремонта кровли (Alkorplan, Sikaplan, Protan, Sarnafil, Monarplan, Fatrafol), так и отечественные (Кровлелон, Пластфоил, LOGICROOF, ECOPLAST).</p>\n\n<p>Поливинилхлорид (или ПВХ) – это oдин из наиболее пожаробезопасных кровельных мембран, срок службы которого более 30 лет.</p>', '2015-08-22 11:27:37', 'Татьяна Кутукова', '1', 'vidikrovlya.jpg'),
	(12, '3', 'Фасадные работы', 'vidi-fasad', 'Фасадные работы, ремонт фасадов, реставрация фасадов, вентилируемые фасады', '<p>За последние годы наша компания выполнила большое количество заказов по ремонту и усилению ограждающих конструкций, фасадов и кровель зданий и сооружений различного назначения, в том числе большой объем работ на промышленных объектах химической отрасли (ОАО «Дорогобуж»; ОАО «Минудобрения»; ЗАО «Агро-Череповец»), а также: Инновационный центр «Сколково»; Машиностроительный завод «ЗиО-Подольск» и др.</p>\n<p>С помощью оригинальных технических решений, разработанных специалистами нашего конструкторского бюро, в рамках крупных проектов  были осуществлены такие работы как: реконструкция нескольких высотных (120 метров) грануляционных башен и восстановление кровельных ограждений с усилением несущих конструкций 3-х арочных складов готовой продукции общей площадью 20 000 м². Везде в работе применяются высококачественные отечественные и импортные материалы. </p>\n<div class="row"><div class="col-md-6"><img src="http://www.vertikal-a.ru/uploads/3s.jpg" /></div><div class="col-md-6"><img src="http://www.vertikal-a.ru/uploads/2s.jpg" /></div></div>\n<h3>Отделка фасадов</h3>\n<p>\nПлан отделки фасадов должен быть разработан исходя из расположения и окружения здания, его назначения, архитектурных особенностей. В связи с тем, что фасад видно «с улицы», крайне важны его декоративные свойства, внешний вид. Однако нужно понимать, что главная задача любого фасада – это  способность защищать стены и внутренние помещения от внешнего воздействия окружающей среды.</p>\n<p>Начальным этапом в процессе отделки становится выбор фасадных материалов: стены здания или постройки снаружи могут быть оформлены универсальным сайдингом из различных материалов, для облицовки коттеджей часто используется натуральный или искусственный камень, дерево, декоративные панели, а офисные центры или административные здания отделывают специальной плиткой или оштукатуривают.</p>\n<p>Все фасадные материалы принято классифицировать на вентилируемые и невентилируемые, а также по способу монтажа – на «сухие» и «мокрые».</p>\n<h3>Вентилируемые фасады</h3>\n<p>Вентилируемые фасадные системы предусматривают наличие вентиляционного пространства между стеной здания (или теплоизоляционным материалом) и фасадным материалом. Свободно циркулирующий воздух в этом пространстве препятствует образованию сырости и не дает влаге конденсироваться на внутренней поверхности отделочного материала. Сам же материал выполняет функцию надежного барьера для погодных явлений, а также служит декоративным элементом.</p>\n<p>В качестве декоративного фасадного материала могут применяться самые разнообразные материалы, отличающиеся не только внешним видом, но и маериалом:</p>\n<ul>\n<li>- керамогранит;</li>\n<li>-композитные многослойные панели;</li>\n<li>- металокассеты;</li>\n<li>- фасадные панели из искусственного камня;</li>\n<li>- натуральный камень;</li>\n<li>- фиброцементные плиты;</li>\n<li>- профлист;</li>\n<li>- металлосайдинг;</li>\n<li>- виниловый сайдинг;</li>\n<li>- полимерные панели;</li>\n<li>- клинкерные панели;</li>\n<li>- терракотовые плиты.</li>\n</ul>\n\n<h3>Невентилируемые фасады</h3>\n<p>Если установка вентфасада не оправдана необходимостью утепления сооружения или отведения влаги с поверхности, стены не «дышащие», то применяют технологию невентилируемых фасадов. Это может быть и плитка, которая клеится непосредственно к самой стене здания, например, в виде кирпичной кладки, и разнообразная штукатурка.</p>\n	\n<h3>Сухие фасады</h3>\n<p>К фасадам «сухого» типа можно отнести системы, крепление которых осуществляется с помощью крепежа (гвоздей, саморезов, дюбелей и проч.), то есть без использования растворов, клеев и красок. Одно из главных преимуществ таких фасадов – это возможность монтажа при любой погоде. К «сухим» фасадам относится сайдинг.<p>	\n\n<h3>Мокрые фасады</h3>\n<p>В настоящее время отлично зарекомендовала себя система так называемых «мокрых» фасадов с использованием утеплителей. «Мокрые» фасады способны решить ряд проблем практического и эстетического характера. В частности, для организации таких фасадов используются высокоэффективные теплоизолирующие материалы, такие, как пенополистирол или минеральный базальтовый утеплитель. А финишный слой отделочной штукатурки позволяет придать облику здания оригинальный характер за счет большого разнообразия фактур и цветов, что будет уместным и для оформления фасада современного здания, и при реконструкции исторических зданий, где использование современных панелей неприемлемо.</p>\n<div class="row"><div class="col-md-6"><img src="http://www.vertikal-a.ru/uploads/4s.jpg" /></div><div class="col-md-6"><img src="http://www.vertikal-a.ru/uploads/6s.jpg" /></div></div>\n<p>Если более подробно рассмотреть устройство «мокрого» фасада, то необходимо отметить следующие слои, из которых обычно состоит система:</p>\n<ul>\n<li>•	Теплоизоляционные плиты</li>\n<li>•	Армирующий слой</li>\n<li>•	Фактурное покрытие</li>\n</ul>\n<p>Теплоизоляционные плиты из пенополистирола или минеральной ваты приклеиваются к наружной стене с помощью полимерного клея и дополнительно фиксируются фасадными дюбелями.</p>\n<p>Армирующий слой представляет собой жесткую и пластичную сетку, которая клеевым раствором монтируется на слой утеплителя. Армирующая сетка играет важную роль в прочности и устойчивости всей фасадной системы. Обычно такая сетка состоит из стекловолокна, в заводских условиях покрытого устойчивым к действию щелочей составом.</p>\n<p>После высыхания армирующего слоя, которое занимает несколько дней, приступают к грунтовке и финишному покрытию фасада пластичной декоративной штукатуркой. </p>\n<p>Необходимо помнить, что устройства фасада «мокрого» типа предъявляет строгие требования к погодным условиям во время монтажа. В осенне-зимний период при ветреной и влажной погоде не рекомендуют проводить работы без обустройства защитных сооружений, где будет поддерживаться необходимая температура. В противном случае, нарушения негативным образом скажутся на прочности системы и, следовательно, на сроке ее эксплуатации.</p>\n', '2015-08-22 11:25:56', 'Татьяна Кутукова', '1', 'vidifasad.jpg'),
	(13, '3', 'Антикоррозионная защита', 'vidi-antikor', 'Работы по антикоррозионной защите, антикоррозийной обработке', '<h3>Антикоррозионная защита</h3>\n<blockquote>Созданная как специализированное предприятие для ремонтно-восстановительных монтажных работ высотных объектов Министерства минеральных удобрений и нефтехимической отрасли, компания "Вертикаль-Альфа" получила богатейший опыт по антикоррозионной защите конструкций и узлов промышленных зданий и сооружений химических производств с жесткими условиями эксплуатации в сильноагрессивных средах, в том числе на высотных и труднодоступных объектах.</blockquote>\n<p>Компания "Вертикаль-Альфа" имеет успешный опыт антикоррозионной защиты морских сооружений - платформ нефтегазодобывающих скважин на Черном море.</p>\n<p>Антикоррозионная защита морских сооружений – это комплекс мер, направленных на повышение стойкости конструкций к воздействию агрессивной морской среды, где разрушение металла во много раз ускоряют вода и соль. Антикоррозийная обработка подобных объектов производится составами на основе хлорсульфированного полиэтилена и модифицированных эпоксидных смол, стойких к действию солей, кислот, нефтепродуктов. </p><p>Антикоррозийная защита внутренних поверхностей резервуаров вышеназванными составами показала высокие результаты в процессе эксплуатации, которые во многом опережают зарубежные аналоги.</p>\n\n<p>Ржавление железа - самый распространенный пример коррозии. Этот процесс со временем под действием кислорода и влаги разрушает железо и его сплавы, например, сталь. Другие материалы также в разной степени подвержены коррозии. В результате, металлические конструкции и установки постепенно, но неминуемо подвергаются разрушению, постепенно теряя свои прочностные свойства и внешний вид. Для ограждения металлических сооружений и элементов от воздействия неблагоприятных факторов среды и защиты от коррозии применяется антикоррозионная обработка.</p>\n<p>Антикоррозийная защита конструкций призвана уменьшить влияние агрессивных сред и условий эксплуатации. </p>\n<p>Чаще всего, для этого применяют лакокрасочные и другие защитные покрытия, которые изолируют поверхность металла от окружающей среды, при этом используют разнообразные антикоррозийные составы и краски, наносимые посредством аппаратов высокого давления.</p>\n<p>Перед нанесением покрытия поверхность с особой тщательностью подготавливается. Хорошая подготовка под покраску - залог качественной антикоррозионной защиты. К подготовительным работам относятся очистка, удаление ржавчины с поверхностей и фосфатирование, которое позволяет улучшить адгезию наносимого покрытия.</p>\n<p>Очистка поверхностей проводится разными методами, вот основные из них:</p>\n<li>-ручная очистка (производиться с помощью ручного инструмента – проволочных щеток, шпателей, скребков, абразивных шкурок, молотков для скалывания ржавчины),</li>\n<li>-механизированная очистка (очистка с помощью электроинструмента – вращающихся проволочных щеток, шлифовальных приспособлей, отбойных молотков и т.п.),</li>\n<li>-сухая абразивная струйная очистка (производится сжатым воздухом путем подачи абразива в поток воздуха, движущегося с высокой скоростью из сопла на очищаемую поверхность),</li>\n<li>-влажная абразивная струйная очистка (осуществляется аналогично струйной очистке со сжатым воздухом с добавлением жидкости (обычно питьевой воды), в результате чего очищение поверхности происходит вследствие воздействия на нее потока воздуха, питьевой воды и абразива),</li>\n<li>-химические и термические методы (как правило, сложны и дороги, поэтому употребляются реже).</li>\n\n<p>Международная система стандартов ISO предусматривает классификацию степеней очистки поверхности: \nручная подготовка поверхности и обработка с помощью электроинструментов обозначается аббревиатурой St, а струйная абразивная очистка – аббревиатурой Sa.</p>\n<h5>ISO-St1. Обработка вручную и электроинструментами</h5>\n<p>Прежде, чем начать очистку вручную или электроинструментами, толстые слои ржавчины должны быть удалены способом обрубки. Видимые загрязнения от масла, жира и грязи тоже должны быть удалены. После очистки вручную и электроинструментами, поверхность должна быть очищена от отслаивающейся краски и пыли.</p>\n<h5>ISO-St2. Тщательная очистка вручную и электроинструментами</h5>\n<p>При поверхностном рассмотрении невооружённым взглядом, подложка должна выглядеть очищенной от видимых следов масла, жира и грязи и от плохо прилегающей окалины, ржавчины, краски и посторонних веществ.</p>\n<h5>ISO-St3. Очень тщательная очистка вручную и электроинструментами</h5>\n<p>То же самое, что и для St2, но подложка должна быть очищена намного более тщательно, до появления металлического блеска.</p>\n<h5>ISO-Sa. Пескоструйная очистка</h5>\n<p>Прежде, чем приступить к пескоструйной очистке, толстые слои ржавчины должны быть удалены методом обрубки. Видимые масляные, жировые загрязнения и грязь тоже должны быть устранены. После пескоструйной обработки подложка должна быть очищена от пыли и мусора.</p>\n<h5>ISO-Sa1. Лёгкая пескоструйная очистка</h5>\n<p>При проверке невооружённым взглядом поверхность должна выглядеть зачищенной от видимых масляных, жировых пятен и грязи и от окалины с плохим прилеганием, ржавчины, краски и других посторонних веществ.</p>\n<h5>ISO-Sa2. Тщательная пескоструйная очистка</h5>\n<p>При проверке невооружённым взглядом поверхность должна выглядеть зачищенной от видимых масляных, жировых пятен и грязи и от большей части окалины, ржавчины, краски и других посторонних веществ. Каждое остаточное загрязнение должно иметь плотное прилегание.</p>\n<h5>ISO-Sa2 1/2. Очень тщательная пескоструйная очистка</h5>\n<p>При проверке невооружённым взглядом поверхность должна выглядеть зачищенной от видимых масляных, жировых пятен и грязи и от большей части окалины, ржавчины, краски и других посторонних веществ. Все остаточные следы заражения должны проявляться только в форме едва заметных пятен и полос.</p>\n<h5>ISO-Sa3. Пескоструйная очистка до визуально чистой стали</h5>\n<p>При проверке невооружённым взглядом поверхность должна выглядеть зачищенной от видимых масляных, жировых пятен и грязи и от большей части окалины, ржавчины, краски и других посторонних веществ. Поверхность должна иметь однородный металлический блеск.<p>\n<img src="http://www.vertikal-a.ru/uploads/1112.jpg"/>\n<p>После прохождения цикла подготовительных этапов антикоррозионной обработки сооружений и металлоконструкций приступают непосредственно к нанесению защитного покрытия. Отлично зарекомендовали себя в этой роли антикоррозионные лакокрасочные покрытия (ЛКП), среди преимуществ которых:</p>\n\n<li>-простое нанесение покрытия,</li>\n<li>-возможность выбора цвета,</li>\n<li>-антикоррозийная обработка больших конструкций и конструкций сложной  конфигурации,</li>\n<li>-низкая стоимость.</li>\n\n\n<h4>КЛАССИФИКАЦИЯ АНТИКОРРОЗИОННЫХ ПОКРЫТИЙ (по условиям эксплуатации)</h4>\n<img src="http://www.vertikal-a.ru/uploads/111.jpg"/>\n\n<p>Антикоррозийная защита – одно из основных направлений деятельности нашей компании, мы готовы предложить Вам весь комплекс услуг по антикоррозионной обработке гражданских и промышленных объектов. При помощи как традиционных, так и новейших технологий, наши специалисты выполнят работу быстро и с соблюдением всех стандартов качества.</p>', '2015-08-22 11:27:14', 'Татьяна Кутукова', '1', 'vidiantikor.jpg'),
	(14, '3', 'Герметизация стыков и межпанельных швов', 'vidi-germetiz', 'Одной из основных проблем панельного домостроения является недостаточная герметичность стыков панелей. Это влечет за собой промерзания и протечки стен, образование в помещениях плесени и потерю тепла.', '<p>Недостаточная герметичность стыков панелей – одна из основных проблем панельного домостроения. Она ведет к промерзанию и протечкам стен, к образованию внутри помещений плесени, а также теплопотери до 10-15%. Необходимость в решении задачи герметизации межпанельных швов и проведении соответствующих работ возникает как при строительстве, так и на разных стадиях эксплуатации зданий.</p>\n<h5>Качественная герметизация улучшает теплоизоляционные свойства панельного здания.</h5>\n<img src="http://www.vertikal-a.ru/uploads/germ.gif" />\n<blockquote>Накопленный нами опыт работы и знание современных технологий и материалов позволяют нам быстро и надежно выполнять любые работы герметизации. Мы сможем провести обследование здания и сделать ремонт только тех швов, которые в нем нуждаются, или швов, находящиехся в самом неблагоприятном состоянии, учитывая финансовые возможности заказчика. </blockquote>\n<p>В комплексе с герметизацией межпанельных швов при разрушении защитного слоя бетона целесообразна обработка наружной поверхности стены гидрофобным составом. Эта мера также существенно уменьшает протечки и примерзания, следовательно, продлевает срок эксплуатации объекта.</p>\n<p>Герметизация швов обычно проводится перед <a href="http://www.vertikal-a.ru/vidi-fasad.htm">фасадными работами.</a></p>\n', '2015-08-22 11:27:28', 'Татьяна Кутукова', '1', 'vidigermetiz.jpg'),
	(15, '3', 'Утепление', 'vidi-ytepl', 'Утепление стеновых ограждений и чердачных перекрытий', '<h3>Утепление</h3>\n<p>Теплоизоляция, выполненная из современных материалов высокого качества, на сегодняшний день является главным требованием энергосберегающего строительства. <strong>Любое строительство или реконструкция влекут вложение значительных средств, поэтому грамотное утепление так важно, чтобы дальнейшие эксплуатационные затраты на обогрев здания не шли также на обогрев наружного воздуха. </strong></p>\n<blockquote>Применение современной и эффективной теплоизоляции стеновых ограждений и чердачных перекрытий позволяет значительно сократить эксплуатационные затраты. Ведь средства, вложенные в хорошую изоляцию, уже через несколько лет возвращаются в виде экономии на отоплении.</blockquote>\n<p>В настоящее время появился целый спектр высокоэффективных теплоизоляционных материалов, как: пенополиуретан (более 10 марок), базальтовые минеральные плиты, экструзионный полистирол (ЭППС, XPS), целлюлозная вата, пеностекло, пенорезол и прочие. Все вышеуказанные материалы имеют широкое практическое применение. </p><blockquote>Для утепления мы поможем Вам выбрать оптимальный теплоизоляционный материал учитывая такие показатели, как: стоимость, технологичность, срок службы, совместимость, огнестойкость и др. </blockquote>\n<p>Применение современных теплоизоляционных материалов дает возможность производить утепление стен как снаружи здания, так и изнутри помещения. <strong>Утепление со стороны фасада здания является предпочтительнее, т.к. при утеплении изнутри помещения следует учитывать, что термическое сопротивление утеплителя не должно быть больше этого показателя у основной стены. </strong>При понижении температуры воздуха снаружи до –10 °С (и ниже), температурный ноль перемещается в теплоизоляционный слой, а следовательно, внутрь помещения. Вследствие чего температура на внутренней поверхности стены понижается более допустимых значений, что влечет образование конденсата. </p>\n<p>Толщина теплоизоляции, необходимая для обеспечения энергосбережения, предлагается в соответствии СНиП II-3-79. Соблюдение требований данного нормативного документа позволяет оптимально выбрать требуемый материал и его толщину. <strong>Это позволяет добиться оптимальной температуры на поверхности стен и внутри помещения, а в случае появления повышенной влажности не позволит возникновению нежелательного конденсата. </strong></p>\n<p>Для того, чтобы добиться высоких показателей теплоэффективности здания, ограждающие конструкции должны иметь термическое сопротивление не менее 3-3,2 м2 °С/Вт. При этом, в зависимости от применяемого теплоизоляционного материала и коэффициента теплопроводности этого материала, толщина теплоизоляции может быть в пределах от 50 до 200 мм. Чем ниже коэффициент теплопроводности, тем тоньше слой теплоизоляции. </p><blockquote>При применении утеплителей на основе базальтового волокна, следует учитывать их гигроскопичность.  Поскольку проникающая в них влага ухудшает их теплоизоляционные свойства (повышается теплопроводность), следует учитывать тепловлажностный режим. </blockquote>\n<img src="/uploads/utp_ris1.gif" />\n<p>Утепление стеновых ограждений, как правило, проводят в комплексе с фасадными работами.\nМы выполняем весь комплекс услуг <a href="http://www.vertikal-a.ru/vidi-fasad.htm">фасадных работ</a> и работ по утеплению стеновых конструкций и чердачных помещений.</p>\n', '2015-08-22 11:26:02', 'Татьяна Кутукова', '1', 'vidiytepl.jpg'),
	(17, '4', 'KNAUF запускает новый бренд', 'new_post3', 'KNAUF Insulation запускает новый бренд, под которым будет выпускаться линейка товаров для защиты дома от воздействия внешней среды. ', '<p>KNAUF Insulation будет выпускать эксклюзивную линейку товаров для защиты дома от воздействия внешней среды. Первые продукты под брендом KNAUFЗащита — это ветро-влагозащитная мембрана «KNAUFЗащита А» и пароизоляционная пленка «KNAUFЗащита В».</p>\n\n<p>Область применения: <a href="http://www.vertikal-a.ru/vidi-ytepl.htm">утепление</a> скатной <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">кровли</a>, <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">кровли</a> на основе металлокаркаса, цокольного перекрытия, каркасные стены, чердачные перекрытия.</p>\n\n<p>Оба продукта имеют все необходимые сертификаты (ГОСТ, пожарный, санитарно эпидемический), а также прошли испытания в ЦНИИ Промзданий.</p>\n\n', '2015-08-22 12:32:34', 'Татьяна Кутукова', '1', 'knauf-z-big.png'),
	(18, '4', 'Усиление проверок пожарной безопасности зданий', 'vopros-otvet', 'Огнепортал сообщает: "В России усиливаются проверки пожарной безопасности зданий".', '<p>По данным Огнепортала.</p>\n\n<p>Бавлинская городская прокуратура заявила в суд о торговом павильоне, в котором нарушены требования пожарной безопасности. Причина прокурорской проверки: обращение местного жителя.\nВ ходе проверки выявлено, что несущие стальные конструкции и косоуры лестничного марша не достигают нужного предела огнестойкости, а <a href="http://www.vertikal-a.ru/vidi-fire.htm">средства огнезащиты</a> не оценены путем испытаний.</p>\n\n<p>Кабардино-Балкарская прокуратура провела проверку организации летнего отдыха. \nВ частности обнаружено, что, в нарушение пункта 21 ППР РФ, в одном из санаториев не была проведена проверка <a href="http://www.vertikal-a.ru/vidi-fire.htm">деревянных конструкций</a> кровли пищеблока, склада и спального корпуса на предмет качества огнезащитной пропитки .</p>', '2015-08-25 12:29:09', 'Татьяна Кутукова', '1', '877.png'),
	(19, '4', 'Новости Подмосковья', 'new_post5', 'В Подмосковье впервые сделают энергоэффективный капремонт.', '<p>Вперые в Подмосковье будет проведен капитальный ремонт многоквартирного дома с применением энергоэффективных технологий. Фонд содействия реформированию ЖКХ сообщает, что первым зданием, где будет проведен эксперимент, станет жилой дом №3 на улице Воровского в Мытищах.</p>\n<p>При капремонте объекта будет применена новая технология <a href="http://www.vertikal-a.ru/vidi-ytepl.htm">утепления фасада</a>. Данная система уже опробована в городах Сибири, хорошо себя там зарекомендовала, срок ее службы составляет порядка 15-20 лет. В случае с домом в Мытищах, производитель материала дает гарантию до 50 лет.</p>\n\n<p>Новшество заключается в облицовочном материале, который представляет собой окрашенную энергосберегающей краской панель из оцинкованного метала с запрессованной внутри минеральной ватой. Панель анкерными болтами прикручивается к фасаду и соединяется специальными замками. Трехцветный цветовой коллаж плитки согласован с жителями дома.</p>\n', '2015-08-22 12:30:01', 'Татьяна Кутукова', '1', 'about_company.jpg'),
	(20, '3', 'Монолитное строительство', 'monolitnoe-stroitelstvo', 'Монолитное строительство — это одна из самых перспективных технологий возведения зданий', '<p>Монолитное строительство — это одна из самых перспективных технологий возведения зданий, сооружений из железобетона, позволяющая возводить здания и сооружения большой этажности и любой формы в короткие сроки.</p>\n<p>Технология строительство монолитных домов уже много лет широко распространена в Европе, где она давно уже зарекомендовала себя как наиболее практичная и надежная, пройдя проверку временем. Преимущества и возможности монолитного строительства делают данное направление одной из наиболее востребованных направлений деятельности нашей компании.</p>\n<p>Наша специализация - это строительство многоэтажных железобетонных зданий и монолитных конструкций любого уровня сложности. Наш опыт и профессионализм гарантируют высокое качество и оперативность выполнения работ.</p>\n\n<h3>Что представляет собой монолитное домостроение?</h3>\n<p>Монолитное строительство – это процесс возведения зданий и сооружений из железобетона. Железобетон, в сущности, представляет собой железный каркас, залитый бетоном. Такая технология позволяет добиться высочайшей прочности всей конструкции, благодаря соединению свойств обоих материалов. Именно поэтому монолитное строительство получило такое распространение по всему миру.</p>\n<img src="http://www.vertikal-a.ru/uploads/monolit_3.jpg" />\n<h3>Монолитные работы (строительство) обычно проводятся в несколько этапов:</h3>\n<ul>\n<li>•	Установка арматурного каркаса. Каркасом будущего строения служит сваренная или скреплённая проволокой железная конструкция. </li>\n<li>•	Установка опалубки. Опалубка – это съемная или несъемная форма, в которую впоследствии будет заливаться бетон. Чаще всего это скрепленные между собой крепкие деревянные щиты, но есть и другие виды опалубки.</li>\n<li>•	Заливка бетона. Строительный бетон заливается в опалубку, в которой предварительно был установлен железный каркас. </li>\n<li>•	В холодное время года свежезалитый бетон прогревают. Это ускоряет его застывание при низких температурах. </li>\n<li>•	Последний этап - это снятие опалубки, если конструкция была съёмного типа.</li>\n</ul>\n\n<p>Индустриальное монолитное строительство из железобетона — это такой вид строительства, при котором основным применяемым материалом является монолитный бетон. Бетонирование конструкций производится в крупносборной инвентарной опалубке, при механизированных и автоматизированных процессах приготовления, перемещения и укладки бетонной смеси.</p>\n<h3>Монолитное домостроение рекомендуется в широком ряде случаев:</h3>\n<ul>\n<li>•	при строительстве зданий  высокой этажности, сложных форм;</li>\n<li>•	в сейсмоопасных районах, районах с  геологическими особенностями;</li>\n<li>•	при отсутствии базы полносборного домостроения и ограниченном объеме строительства, а также при освоении новых территорий. Монолитные работы требуют минимального количества техники.</li>\n', '2015-08-22 11:25:13', 'Татьяна Кутукова', '1', 'monolit.jpg'),
	(21, '3', 'Строительство коттеджей и домов', 'stroitelstvo-kotedgeiy', 'Малоэтажное строительство', '<h3>Строительство коттеджей и домов</h3>\n<p>Что такое фундамент дома, наверное, знает каждый человек. <strong>Фундамент</strong> в понятии строительства - это подземная часть здания (сооружения), воспринимающая нагрузки и передающая их на основание. Основание - это пласты плотного грунта.</p>\n<p>Верхняя плоскость фундамента, на которой располагаются надземные части здания или сооружения, называется поверхностью фундамента или обрезом, а нижняя его плоскость, непосредственно соприкасающаяся с основанием - подошвой фундамента.</p>\n<p><strong>Ленточный фундамент</strong> – это железобетонная полоса, идущая по периметру всего здания. Ленту закладывают под все внутренние и наружные стены застройки, сохраняя одинаковую форму поперечного сечения по всему периметру фундамента. Технология изготовления ленточного фундамента достаточно проста по сравнению с плитным или свайным фундаментом. Но ей свойственна повышенная трудоёмкость и большой расход материала в сравнении со столбчатым видом фундаментов (больший объем бетона, большее количество опалубки, обязательное применение крана). <strong>Ленточные фундаменты применимы:</strong></p>\n<p>•	для домов с бетонными, каменными, кирпичными стенами (плотность которых больше 1000-1300кг/куб.м);</p>\n<p>•	для домов с тяжёлыми перекрытиями (монолитные или сборные железобетонные, металлические);</p>\n<p>•	в случае, если существует угроза неравномерных осадок фундаментов, из-за неоднородности грунтов на участке (к примеру, участок сложен в одной части песками, а в другой пучинистыми суглинками). Ленточный армированный фундамент сработает как одно целое, перераспределит усилия и стены дома не дадут трещин и деформаций;</p>\n<p>•	если в доме планируется подвал или цокольный этаж, при этом стены ленточного фундамента образуют стену подвального помещения.</p>\n<blockquote><p>Планируя строительство дома очень важно ответственно и грамотно подойти к выбору типа фундамента будущего строения, так как это один из важнейших конструктивных элементов постройки. Ошибка, заложенная в начале строительства, неверно спроектированный фундамент, экономия строительного материала, как правило, ведет к серьезным негативным последствиям при эксплуатации дома. Возникают такие проблемы как перекосы фундамента, перерасход материалов, вертикальные и горизонтальные деформации, неравномерные осадки, трещины в несущих конструкциях. От надежности фундамента в огромной степени, зависят многие качества постройки, а также ее капитальность и долговечность.</p></blockquote>\n<p>Помните, нулевой цикл возведения здания (подготовка основания, сооружение фундаментов) - это дорогой процесс и составляет, как правило, треть стоимости всей постройки. Лучше закажите проект опытным проектировщикам, да и спросить потом в случае чего можно с них, правильно составив договор. В проекте организация - подрядчик грамотно и обоснованно выберет Вам тип и материал фундамента.</p>\n<strong></strong>\n<blockquote><p>Часто возникают вопросы: какой вид фундамента следует делать для того или иного дома и зависит ли этот выбор от типа грунта и прочих условий. Мы ответим на них и расскажем о существующих видах фундаментов и их применении.</p></blockquote>\n<p>Чаще всего основу здания сооружают из бетона или железобетона. Иногда сочетают с кирпичной или каменной кладкой. Есть и еще несколько разновидностей. Выбор здесь зависит от нескольких факторов: величины будущего сооружения, вида грунта и глубины его промерзания, уровня грунтовых вод.</p>\n<p><strong>Песчаные</strong></p>\n<p>Устраивают в виде заглубленных в грунт лент из крупного или гравелистого песка с верхним слоем из щебня, гравия или кирпичного боя. Применяют для небольших одноэтажных зданий на непучинистых почвах с низким уровнем грунтовых вод и хорошим поверхностным водоотводом. Этот вид — самый дешевый из ленточных.</p>\n<p><strong>Кирпичные</strong></p>\n<p>При сухих грунтах и мелком заложении фундаменты делают из любого кирпича, при влажных пускают в ход только хорошо обожженный глиняный. В этом случае нужна защита от агрессивных вод. По долговечности уступают бутовым и бутобетонным. При высоком стоянии грунтовых вод и большой глубине заложения применять эту разновидность не рекомендуют.</p>\n<p><strong>Бутовые</strong></p>\n<p>Возводят из крупного булыжника, рваного и плитнякового камня на цементном растворе. Довольно материалоемки, особенно при глубоком заложении на пучинистых грунтах. Чаще всего применяют в зданиях с тяжелыми ограждающими конструкциями.</p>\n<p><strong>Бутобетонные</strong></p>\n<p>В отличие от бутовых сооружают в опалубке или траншее с вертикальными стенками путем утапливания в раствор мелкого камня, щебня или крупного гравия с послойной трамбовкой. Применяют для всех типов сельских зданий, практически на любых основаниях.</p>\n<p><strong>Бетонные</strong></p>\n<p>Их делают из готовой бетонной смеси или бетонных блоков. По расходу цемента предыдущий вариант экономичнее. При монолитном решении фундаменты выполняют в опалубке, что позволяет придать им любую заданную форму, в том числе сделать наклонные стены, столь необходимые при работе на пучинистых грунтах. На других почвах лучше применять бетонные блоки.</p>\n<p><strong>Железобетонные</strong></p>\nИз всех типов наиболее надежны и долговечны. Можно применять на любых грунтах, но особенно эффективны на пучинистых. Их считают самыми экономичными.\n<p>Выбор той или иной конструкции в основном зависит от геологической характеристики грунтов (состав, несущая способность, уровень грунтовых вод, глубина промерзания). Имея эти сведения, можно определить глубину заложения и сечение фундамента. На сухих и маловлажных (непучинистых) грунтах применяют все перечисленные выше типы, причем самые дешевые из них — песчаные из крупнозернистого песка и кирпичные. А вот на супесях, суглинках и глинах нужен бетон.</p>\n<strong></strong>\n<p><strong>По способу опоры на грунт различают следующие фундаменты:</strong></p>\n<p>•	ленточные;</p>\n<p>•	столбчатые (свайные);</p>\n<p>•	плитные.</p>\n<strong></strong>\n<p><strong>Ленточные фундаменты</strong></p>\nСуществует заблуждение, что они наиболее предпочтительны, так как имеют одинаковую форму поперечного сечения по всему периметру стен здания (в том числе под всеми его внутренними несущими стенами). На самом деле для небольших домов такой фундамент — очевидное излишество, по крайней мере, с точки зрения несущей способности. Этот вид возводят в основном под тяжелыми зданиями. В пучинистых и глубоко промерзающих грунтах его применяют достаточно редко. Правда, здесь следует сделать оговорку. Сегодня все больше и больше загородных домов строят с эксплуатируемыми подвалами, в которых можно поместить бассейн, сауну, бильярдную, различные подсобные помещения. В подобных случаях больше подойдет именно ленточный фундамент.\n<p>Для него часто используют готовые блоки, связывая их цементным раствором. Но в случае пучинистых грунтов это не лучший вариант, поскольку соединения блоков — слабые места такого фундамента, и зимой он из прямого может стать зигзагообразным. Значительно лучше, хотя и сложнее, сделать его монолитным, предварительно соорудив в траншее или опалубке сетку из арматурных прутьев, связанных между собой проволокой или сваренных. Арматура должна образовывать цельную конструкцию и захватывать отмостку. Заливать бетон нужно равномерно по всей площади, в идеале — сразу и целиком. Доступно и целесообразно устройство ленточных фундаментов на сухих непучинистых грунтах. По расходу материалов они будут близки к столбчатым, поскольку в этих условиях используют достаточно мелкое заложение.</p>\n<p><strong>Плитные фундаменты</strong></p>\n<p>Этот вариант считают наиболее распространенным и дешевым. По расходу материалов и затратам труда они в 1,5–2 раза, а при глубоком заложении в 3–5 раз экономичнее ленточных. Особенно эффективны в пучинистых грунтах при их глубоком промерзании. Есть у столбчатых фундаментов и недостатки, точнее, ограничения, препятствующие применению. Во-первых, они плохи в горизонтально-подвижных грунтах из-за недостаточной устойчивости к опрокидыванию. В этом случае необходимо устройство жесткого железобетонного ростверка. Во-вторых, их применение на слабонесущих грунтах при строительстве домов с тяжелыми стенами затруднено. В-третьих, при закладывании таких фундаментов возникают сложности с устройством цоколя: пространство между столбами и стеной заполняют землей (забирка), что довольно сложно и трудоемко. В случае с ленточным вариантом такой проблемы не существует. Наконец, свайные фундаменты неприменимы, когда под домом хотят сделать подвал или теплый подпол, так как основной их элемент — столб (свая). Он может быть деревянным, каменным, кирпичным, бетонным и железобетонным. Можно в качестве формы использовать и асбестовую трубу, заполнив ее бетонной смесью.</p>\n<p><strong>Плиточные фундаменты</strong></p>\nИх сооружают на тяжелых пучинистых и просадочных грунтах. Такие фундаменты — разновидность мелкозаглубленных ленточных. Но они имеют жесткую конструкцию — одну плиту, выполненную под всей плоскостью здания. Ее выполняют либо из монолитного железобетона, либо из сборных перекрестных железобетонных балок с жесткой заделкой стыковых соединений.\nДвигаясь вместе с грунтом, они хорошо выравнивают все вертикальные и горизонтальные перемещения почвы, и потому их называют еще плавающими.\n<p>Их устройство требует большого расхода бетона и металла (на арматуру), и чаще всего такие фундаменты применяют в малоэтажном строительстве при сооружении небольших и простых по форме зданий, причем, как уже было сказано, на тяжелых пучинистых, подвижных и просадочных грунтах.</p>', '2015-08-22 11:25:00', 'Татьяна Кутукова', '1', 'fasadi_3.jpg'),
	(22, '3', 'Промышленный альпинизм', 'promishlenniy-alpinism', 'Высотные работы на сооружениях различного назначения', '<p>Промышленный альпинизм – это один из специализированных методов, позволяющих проводить высотные работы на сооружениях различного назначения. Метод промышленного альпинизма позволяет ощутимо сократить расходы на проведение работ на высоте. Альпинисты промышленной сферы выполняют работу в сжатые сроки, при этом избавляя от необходимости установки монтажных люлек, на что может уйти до нескольких недель.</p>\n<p>Комплекс методов промышленного альпинизма дает возможность выполнять высотные работы, в том числе, в труднодоступных местах:</p>\n<ul>\n<li>фасадные работы; </li>\n<li>кровельные работы;</li>\n<li>высотный монтаж; </li>\n<li>герметизация межпанельных швов высотных зданий;</li>\n<li>внешнее утепление;</li>\n<li>реставрационные и штукатурные работы.</li>\n</ul>\n<p>Особенно актуально привлечение промышленных альпинистов при выполнении антикоррозийных работ выхлопных труб и подобных сооружений, где установка лесов или подъемных механизмов экономически нецелесообразна или невозможна из-за стесненности или других факторов.</p>\n<p>Создаваясь как специализированное предприятие для ремонтно-восстановительных монтажных работ высотных объектов Министерства минеральных удобрений и нефтехимической отрасли, компания «Вертикаль-Альфа» имеет штат высококлассных аттестованных сотрудников, накопивших существенный опыт ведения высотных работ любой сложности. Мы сможем предоставить профессиональные услуги на сложных объектах, от работы с которыми могут отказаться другие компании. </p>\n', '2015-08-22 11:26:10', 'Татьяна Кутукова', '1', 'alpinism_1.jpg'),
	(23, '4', 'Действительно ли необходима огнезащита?', 'ognezashita', 'Рассмотрим данный вопрос.', '<p>Всем известно, что металл не горит. Поэтому возникает вроде бы логичный вопрос: зачем нужна <a href="http://www.vertikal-a.ru/vidi-fire.htm">огнезащита металлоконструкций</a>?</p>\n<p>Дело в том, что во время пожаров температура может достигать 500 градусов. Под воздействием таких температур металл меняет свои свойства, становясь гораздо менее прочным и теряя надежность в эксплуатации. <p>Поэтому металлоконструкциям тоже необходима огнезащита.</p>\n\n<p>В последнее время службы Государственного пожарного надзора все больше ужесточают контроль над пожарной безопасностью зданий и сооружений, т.к. заметно увеличилось количество пожаров.  Сейчас очень серьезное внимание уделяется огнезащите древесины и других материалов, а также профилактике пожаров. Тем более, что на данный момент для снижения пожарной опасности стройматериалов и конструкций уже созданы во множестве эффективные способы и средства огнезащиты для дерева и прочих материалов.</p>\n\n<p>Существуют конструктивные средства огнезащиты, которые учитывают уже на этапе проектирования здания. Это  создание теплоотражающих экранов, облицовка теплоизоляционными материалами, специальный способ оштукатуривания, увеличение поперечного сечения конструкций.</p>\n\n<p><a href="http://www.vertikal-a.ru/vidi-fire.htm">Огнезащита деревянных конструкций</a> чаще осуществляется с помощью обработки антипиренами (химическими средствами огнезащиты дерева). </p>\n', '2015-09-01 01:43:09', 'Татьяна Кутукова', '1', 'DSC00647.JPG'),
	(24, '4', 'Изменения закона о самострое', 'samostroy', 'С 1 сентября в России изменились правила по самовольной застройке.', '<p><strong>Первого сентября  вступила в силу новая редакция ФЗ № 258 о самовольной застройке в России. Теперь узаконить самострой станет намного труднее.<strong></p>\n<p>До названных изменений владельцы таких объектов могли узаконить свои права, если права других лиц не были нарушены и жизни и здоровью граждан не создавалось угрозы. </p>\n<p>Граждане пользовались этим и оформляли право собственности на "самострой" через суд, а суды примерно 9 из 10 исковых требований о признании права собственности на самовольную постройку удовлетворяли.</p>\n<p>Но теперь в законе прописаны новые требования и узаконить самовольную застройку будет гораздо сложнее.</p>\n<p>C 1/09/15 стали необходимы права на земельный участок, допускающие строительство на нем предполагаемого объекта; постройка должна соответствовать документации по планировке территории или требованиями к постройке, указанным в иных документах.</p>\n<p><em>Информация сайта http://www.stroygaz.ru/ostorozhno-lazeyki-zakryvayutsya/</em></p>\n', '2015-09-03 15:56:27', 'Татьяна Кутукова', '1', '83.jpg'),
	(25, '4', '«Огнезащитные покрытия». Конференция.', 'fire', '19–20 октября 2015 г в Дюссельдорфе состоится Конференция "Огнезащитные покрытия".', '<p>В октябре 2015 года в Германии состоится Конференция "Огнезащитные покрытия".</p>\n<p>Дюссельдорфская конференция обсудит научно-исследовательские проекты, последние разработки в области <a href="http://www.vertikal-a.ru/vidi-fire.htm" />огнезащиты</a>, актуальные вопросы нормативно-правового регулирования.</p>\n<p>Ведущие международные эксперты выступят с докладами по ключевым вопросам: </p>\n<p>составы на основе фосфатов, пентаэритрита, меламина; </p>\n<p>универсальность против долговечности - интумесцентные покрытия;</p>\n<p>огнестойкость материалов для ограждающих строительных конструкций.</p>\n\n<p>Каждому слушателю конференции откроется великолепный шанс найти партнеров, обсудить актуальные проблемы, а также лично задать вопросы докладчикам, сообщает Огнепортал.</p>', '2015-09-05 13:23:20', 'Татьяна Кутукова', '1', '010.jpg'),
	(26, '4', 'Мансарда', 'mansarda', 'СТРОИТЕЛЬСТВО И ДИЗАЙН МАНСАРДЫ ДОМА', '<p>Для многих из нас мансарда – это мечта детства. И эту мечту можно осуществить! \n<p>В мансарде нет унылого кубического объема привычного жилья, она создает ощущение близости к небу и  природе. </p>\n<p>Французский архитектор Франсуа Мансар, творивший во времена Людовика XIV, предложил размещать жилье прямо под крышей. Зачем пустовать чердакам, если они могут стать отличным жильем? Так и появились первые мансарды. А художники и писатели создали ей богемную славу.</p>\n<p>Современная мансарда — стильное и комфортное жилье, дающее возможность любоваться рассветами, закатами и звездным небом. </p>\n<p> А чтобы мансарда стала такой, обратите внимание на некоторые существенные моменты:</p>\n<p>1.	Форма <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">кровли</a> имеет значение. Двускатная крыша увеличит пространство чердачного этажа.</p>\n<p>2.	Соотношение угла наклона <a href="http://www.vertikal-a.ru/vidi-krovlya.htm">кровли</a> к полу. Чем больше наклон, тем больше площадь. </p>\n<p>3.	Расчет нагрузки (например, снеговой) на кровлю. Необходима стропильная система.</p>\n<p>4.	Взаимосвязь конструктивных особенностей мансарды со структурой всего здания. Особенности несущих конструкций, которые могут быть изготовлены из металла, дерева и железобетона.</p>\n<p>5.	Монтаж окон. 1) Высота от пола до ручки окна = 185-205 см. 2) Размер окна = 10 % от площади пола (для оптимального освещения).</p>\n<p>6.	Учет расположения коммуникаций, соблюдение требований пожарной безопасности.</p>\n<p></p>\n<p>Общая схема выглядит так: кровельное покрытие, обрешетка, гидроизоляция, слой утеплителя, пароизоляция, фанера (или гипсокартон), отделочный материал (вагонка). </p>\n\n<p>Недопустимо нарушать режим вентиляции, укладывать гидроизоляционную пленку лицевой стороной внутрь помещения, применять материалы без огнезащитной обработки, допускать негерметичность пароизоляционного слоя.</p>\n<p>В схему несущей конструкции мансарды входят: стойки, скоба, балки чердачного перекрытия, стропило (боковое и коньковое), обвязка мансардной стены. </p>\n<img src="http://www.vertikal-a.ru/uploads/011.jpg" alt="мансарда"  />\n<p>Для оптимального размера мансарды:</p>\n<p>1)   угол наклона стропил = 30-60º,</p>\n<p>2)   min ширина мансарды = 3 м,</p>\n<p>3)   h в центральной точке = 2,2 м. </p>\n<p>     Слeдует заранee прoдумать распoлoжение лестницы и oкoн.</p>\n<p>При выборе дерева в  качестве материала необходимо <a href="http://www.vertikal-a.ru/vidi-remont.htm">обработать пиломатериал огнезащитным средством</a>.</p>\n<p>     Определяя полезную площадь мансарды обратите вниманиe на зоны, гдe высота потолка меньше 1,9 метра. Испoльзуйтe каждый угoлoк. Там, где высота мансарды больше 1,4 метра  можно расставить пуфы и тумбы. </p>\n<p>     Мансарда с аттиковой (вертикальной) стенкой высотой 200-210 см неотличима комнаты с обычным потолком. Если высота такой стенки превышает 75 см, можно ставить возле нее письменный стол – доступ к нему будет легким и удобным. При низкой аттиковой стенке возведите фальшстенку, она отделит те участки мансарды, которые невозможно использовать полноценно и сэкономит на отоплении и отделке. </p>\n<p>     Окна в фронтонных стенах часто встречаются в домах с двухскатными крышами. Плюсы: форма может быть любой, эффективность освещения всегда высокая. Окна в кровельных скатах. Плюсы: тоже пропускают много света. Нюансы: если окно расположить низко, света будет маловато, если высоко – нельзя выглянуть наружу. Длина окна зависит от угла наклона ската: чем он меньше, тем длиннее должно быть окно. Окна в люкарнах. Нюансы: пропускает гораздо меньше света.</p>\n<p>     Как вписать в интерьер элементы конструкции крыши? Найдите место стропилам, изучите план конструкции крыши! Строительные детали могут быть спрятаны в стенах или выставлены на вид. Во втором случае нужно решить, можно ли органично вписать их в интерьер. Стропильным элементам не место посередине помещения, напротив окон или вблизи дверного проема. Проверьте наличие подкосов. Наклонные элементы, поддерживающие горизонтальные балки, уменьшают высоту помещения. Следите за качеством древесины. Если нет возможности спрятать все элементы конструкции крыши, позаботьтесь о том, чтобы видимые участки были качественно обработаны и отделаны.  </p>\n<p>     Какая форма крыши лучше? Если крыша двухскатная, изнутри скаты мансарды будут выглядеть вполне гармонично. А вот скаты многощипцовой крыши могут создать проблемы  с отделкой помещения и уменьшат полезную площадь. Чтобы сгладить сложную конфигурацию, можно обшить мансарду гипсокартонными листами, закрывая бесполезные участки и выравнивая поверхности по основным плоскостям.</p>\n <p>Дизайн чердачного помещения зависит от его предназначения.  </p>\n\n<a href="https://fotki.yandex.ru/users/vertikal-a/view/1401450/"><img src="https://img-fotki.yandex.ru/get/4522/1559190.b/0_15626a_701c9a4f_L.jpg" title="" alt="" border="0"/></a>\n<a href="https://fotki.yandex.ru/users/vertikal-a/view/1401451/"><img src="https://img-fotki.yandex.ru/get/17865/1559190.b/0_15626b_7068bb90_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401452/"><img src="https://img-fotki.yandex.ru/get/5011/1559190.b/0_15626c_25d3cdb2_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401453/"><img src="https://img-fotki.yandex.ru/get/15558/1559190.b/0_15626d_3846252b_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401454/"><img src="https://img-fotki.yandex.ru/get/17835/1559190.b/0_15626e_8def9e4f_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401455/"><img src="https://img-fotki.yandex.ru/get/3314/1559190.b/0_15626f_33f49928_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401456/"><img src=