-fotki.yandex.ru/get/17859/1559190.c/0_1562ba_e3814100_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401531/"><img src="https://img-fotki.yandex.ru/get/6828/1559190.c/0_1562bb_f1cbf152_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401532/"><img src="https://img-fotki.yandex.ru/get/15591/1559190.c/0_1562bc_66c6dba8_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401533/"><img src="https://img-fotki.yandex.ru/get/6211/1559190.c/0_1562bd_c3d26961_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401534/"><img src="https://img-fotki.yandex.ru/get/5002/1559190.c/0_1562be_3702e864_L.jpg" title="" alt="" border="0"/></a><br/><br/><a href="https://fotki.yandex.ru/users/vertikal-a/view/1401535/"><img src="https://img-fotki.yandex.ru/get/4529/1559190.c/0_1562bf_df0db2c5_L.jpg" title="" alt="" border="0"/></a><br/><br/></cut></lj-cut>\n<object width="500" height="375"><param name="bgcolor" value="#000000" /><param name="movie" value="https://fotki.yandex.ru/swf/slideshow?author=vertikal-a&mode=album&effects=1&time=5&id=488572" /><param name="allowFullScreen" value="true" /><param name="allowNetworking" value="all" /><embed src="https://fotki.yandex.ru/swf/slideshow?author=vertikal-a&mode=album&effects=1&time=5&id=488572" allowFullScreen="true" width="500" height="375" allowNetworking="all"type="application/x-shockwave-flash" bgcolor="#000000" /></object>\n', '2015-09-14 13:51:58', 'Татьяна Кутукова', '1', '2%20%281%29.jpg'),
	(27, '4', 'Огнезащита металлоконструкций. Огнезащитные покрытия. Исследования.', 'ognezashita2', 'Результаты исследований по оценке эффективности и изучению механизма действия силиконовых покрытий, являющихся теплостойкой защитой сплавов железа.', '<p><a href="http://www.vertikal-a.ru/vidi-fire.htm">Огнезащита металлоконструкций</a> дает возможность при пожаре длительное время удерживать свойства металлических конструкций зданий и сооружений.</p>\n<p>В этом году "Bezpieczeństwo i Technika Pożarnicza" опубликовал исследования, выявившие воздействие высоких температур и открытого пламени на перемену величины слоя теплостойких защитных материалов металлоконструкций.</p>\n<p>Анализ происходил в печи с электро контролем. Компоненты исследуемых материалов оценивали микроскопом с рентген зондом и авто электро эмиссией.</p>\n<p>В итоге исследователи выявили, что <a href="http://www.vertikal-a.ru/vidi-fire.htm">огнезащита металлоконструкций</a>, результативность теплостойких свойств исследуемых материалов различна.</p>\n<p>И при действии свободного пламени, и при высоких температурах, отличные свойства показывает лак. Его толщина меняется с 13 до 51 процента. Силиконовая краска дает результат от 13 до 20. Открытое пламя проявляет следующий результат: лак -5, краска -9 процентов.</p>\n<p>Понижение слоя теплостойкого материала связано с фрагментарным плавлением элементов структуры, из-за чего большое количество тепла задерживается.</p>\n<p>В структуре испытуемых составов проявляются серьезные отличия, обнаруживаемые во время элементарной оценке расположения элементов. Отличия относятся к содержанию железа, угля, алюминия. Объем алюминия в краске равен 7%, железа - примерно 20%, а в лаке мы наблюдаем следующую ситуацию: 51% алюминия и 1% железа. Угля в краске в 2 раза больше, чем в лаке (20% и 10%).</p>\n<p>Действие огня в первую очередь касается количества угля в покрытиях. Выяснилось, что количество угля в краске понижается в 3 раза (открытый огонь) и в 10 раз (печь). У лака, независимо, открытый огонь или печь, понижается в 2,5 раза.</p>\n<p><a href="http://www.vertikal-a.ru/vidi-fire.htm">Огнезащита металлоконструкций</a> – крайне значительный элемент безопасности каждого сооружения. Малая стоимость работ по огнезащите, особенно ввиду возможных убытков от пожара, абсолютно оправдывает их осуществление на любых промышленных и жилых объектах.</p>\n<p>"Вертикаль-Альфа" оказывает весь комплекс услуг: огнезащита металлоконструкций, огнезащита воздуховодов, огнезащита кабелей, огнезащита древесины и деревянных конструкций. Наши специалисты, имеют высокую квалификацию, большой опыт, всегда в курсе современных требований и исследований в данной области. Они выполнят огнезащиту конструкции вашего здания или сооружения качественно и надежно.</p>\n\n\n', '2015-09-24 17:47:02', 'Татьяна Кутукова', '1', '1%20%281%29.jpg'),
	(28, '6', 'Вертикаль-Альфа - высокий профессионализм и забота о клиенте!', 'otsiv', 'Благодарность', 'Благодарим Компанию "Вертикаль -Альфа" за качество и своевременность заказанных работ!', '2015-09-29 11:11:47', 'Татьяна Кутукова', '1', '1.jpg'),
	(29, '4', 'Международная конференция 29 октября', '29102015', 'Международная конференция «Огнезащита и пожарная безопасность» в Тюмени ', '<p>В конце октября в Тюмени состоится конференция, она будет посвящена огнезащите и актуальным новинкам и важнейшим исследованиям ведущих представителей отрасли.</p>\n<p>Для организации Вертикаль-Альфа это довольно интересное событие, ведь мы уже почти двадцать лет представляем весь комплекс услуг по позициям: <a href="http://www.vertikal-a.ru/vidi-fire.htm">огнезащита металлоконструкций, огнезащита воздуховодов, огнезащита кабелей, огнезащита древесины и деревянных конструкций</a>.</p>\n<p>Огнезащита – комплекс действий, направленных на повышение огнестойкости конструкций, предупреждение возникновения возгораний и уменьшение результатов пожаров. </p>\n\n<p>Мы рекомендуем не ограничиваться каким-либо одним аспектом противопожарной безопасности конструкции или сооружения, а проводить комплексные меры по огнезащите. Ведь это позволит избежать тяжелых и затратных последствий.</p>\n<p>А профессионалы компании Вертикаль-Альфа, обладая огромным опытом и сотрудничая с передовыми научно-исследовательскими институтами, помогут результативно и грамотно решить возникшие вопросы в короткие сроки.</p>\n\n<p>Упомянутое событие затронет важные вопросы, требующие рассмотрения и изучения:</p>\n\n<p>•	Первоочередные пункты безопасности.</p>\n<p>•	Технологические новинки.</p>\n<p>•	Продуктивные противопожарные покрытия.</p>\n<p>•	Требования к созданию огнезащитных материалов.</p>\n<p>•	Охраняющие от пожара двери, стекла и многое другое.</p>\n<p>•	Агрегаты контроля и измерения.</p>\n<p>•	Оборудование для нанесения огнезащитных веществ.</p>\n<p>Состоятся конференции на темы современных систем огнезащиты и пожаротушения, огнезащиты объектов нефтегазовой и химической отраслей, проблем огнезащиты металлических и деревянных конструкций.</p>\n\n<p>Когда: 29/10/2015</p>\n<p>Где: город Тюмень </p>\n<p>Что: Конференция "<a href="http://www.vertikal-a.ru/vidi-fire.htm">Огнезащита</a> и пожарная безопасность". </p>\n\n<p>Заявку на участие направляйте в Оргкомитет:</p>\n<p>адрес: г. Екатеринбург, ул. Цвиллинга, дом 6, офис 503, индекс 620142;</p>\n<p>телефон: +7(343)2213833; e-mail: mail@ogneportal.ru.</p>\n\n<p>Рассказ о том, как прошла предыдущая конференция на тему огнезащиты и пожарной безопасности в Дюссельдорфе (она прошла 19-20 октября этого года) читайте на страницах интерет-ресурса Огнепортал.ру.</p>\n\n\n', '2015-10-22 16:40:47', 'Татьяна Кутукова', '1', '1.png');
