	(1, 'www.lifechurch.tv', 'LifeChurch.tv wants to make a lasting difference in your life, in our community, and in the world.', 'www.lifechurch.tv', 'LifeChurch.tv wants to make a lasting difference in your life, in our community, and in the world.\nWe are passionate about serving the global community and demonstrating God\'s love to others. Whether in person or online, individually or in groups, within our church and around the world, we are focused on supporting and engaging in relationships that provide relief and restoration to a hurting world.', 'lifechurch_tv', 'anons', '2015-04-06 17:05:15', 'lifechurch_icon.jpg');
